INSERT INTO `aftersales_setting` VALUES ('1310464170382077953', '2020-09-28 06:19:40', '2020-10-09 11:00:15', '4', '<p>网购商品所享受的售后服务，原则上与实体店购物的售后服务一致。建议客人可持商品及购物凭证到环市东店/小象电商outets购物中心的对应专柜处理，实体店接待网购商品的售后服务时，与实体店购买商品的售后服务原则一致。若客人不便亲临商店处理售后事宜，则按《小象电商网上商城退换货政策》操作。<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; 退换货政策细则：<br><br>&nbsp;&nbsp;&nbsp;\r\n \r\n以下类别商品自签收7日内，如商品未使用及包装保持出售时原状且配件齐全，我们将提供全款退换货的服务。退换货时，请您务必将保持完好的品牌包装、内带附件、标签、说明书等，如有发票或赠品需同商品一起退回。如商品包装破损或丢失，即便在退换货期内，也无法为您办理（质量问题除外）。我们将自收到退回商品之日起7天内返回您支付的商品价款，退回商品的运费由您承担。<br><br>&nbsp;&nbsp;&nbsp; 1.鞋靴类商品；<br>&nbsp;&nbsp;&nbsp; 2.箱包类商品；<br>&nbsp;&nbsp;&nbsp; 3.服装类商品；<br>&nbsp;&nbsp;&nbsp; 4.家居用品类商品；<br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; 以下类别商品快递公司配送到货后，请当面验货，一旦签收，无质量问题不予退换。<br><br>&nbsp;&nbsp;&nbsp; 1.内衣裤袜类产品；<br>&nbsp;&nbsp;&nbsp; 2.化妆品及个人护理产品； <br>&nbsp;&nbsp;&nbsp; 3.食品保健类商品；<br>&nbsp;&nbsp;&nbsp; 4.数码电器类商品；<br>&nbsp;&nbsp;&nbsp; 5.精品工艺类商品；<br><br><br>网购商品所享受的售后服务，原则上与实体店购物的售后服务一致。建议客人可持商品及购物凭证到环市东店/小象电商outets购物中心的对应专柜处理，实体店接待网购商品的售后服务时，与实体店购买商品的售后服务原则一致。<br><br>&nbsp;&nbsp;&nbsp; 若客人不便亲临商店处理售后事宜，则按以下流程操作。小象电商售后服务中心将为您提供优质、专业的售后服务：<br>&nbsp;&nbsp;&nbsp; （1）商品退换货政策<br>&nbsp;&nbsp;&nbsp; 自商品签收7日内，如商品及包装保持出售时原状且配件齐全，小象电商网上商城提供一次退换货服务。具体品类的退换货政策以《商品退换货政策》细则为准。<br>&nbsp;&nbsp;&nbsp; （2）售后服务流程说明<br>&nbsp;&nbsp;&nbsp; 售后服务包括商品退货、换货、维修、投诉四类。您可以在签收商品7日内，在线提交售后服务申请，填写相应的售后服务要求。收到您的申请后，我们的售后服务人员将与您联系，为您提供个性化贴身的售后服务。<br>&nbsp;&nbsp;&nbsp; （3）售后服务商品维修<br>&nbsp;&nbsp;&nbsp; 在线申请商品维修仅对三包期内小象电商网上商城出售的商品进行故障、损坏的维修。为了给您提供更完善的服务，服装类尺寸修改、数码类产品改装等个性化售后服务，请您带齐相关物品及票据亲临商场，我们将根据您的要求为您服务。<br><br>友情提示：<br><br>&nbsp;&nbsp;&nbsp; 一张订单只为您提供一次退换货服务。请详细阅读《小象电商网上商城退换货政策》细则后与我们联系；<br>&nbsp;&nbsp;&nbsp; 请您确保退换货时，商品吊牌、标签、收货单及各种包装完整，如购买时索要发票，一经退货请将发票随商品一同寄回，丢失或缺损将无法办理退换货；<br>&nbsp;&nbsp;&nbsp; 退换货发生时，请您选择普通快递将商品寄回给我们。因质量问题换货的商品将免费为您配送，礼包或套装中的商品不可以部分退货；如您购买时收到相关赠品，一经退货请将全部赠品一同寄回，并确保赠品包装完整且未使用，如丢失或损坏无法办理退换货。<br>&nbsp;&nbsp;&nbsp;\r\n \r\n若非质量问题商品退换货需要寄回给我们，请根据申请单反馈的提示信息将商品以快递的方式发往小象电商网乐购（拒绝签收需到付的快递包裹）。我们收到包裹后，会对您退回的商品进行检测。如属于商品质量问题的，我们将根据您的要求对商品作退换或维修处理并返还您垫付的快递费用（请您注意使用合理的方式进行邮寄或快递，我们会根据运单金额实报，最高报销金额为15元），邮费将返还于您该单购物的原支付平台账户。<br>&nbsp;&nbsp;&nbsp; 我们会在收到您寄回商品后的2-3天完成质检，质检不符合退换货标准的，我们将会把商品原物寄还给您。<br></p>', '<p>网购商品所享受的售后服务，原则上与实体店购物的售后服务一致。建议客人可持商品及购物凭证到环市东店/小象电商outets购物中心的对应专柜处理，实体店接待网购商品的售后服务时，与实体店购买商品的售后服务原则一致。若客人不便亲临商店处理售后事宜，则按《小象电商网上商城退换货政策》操作。<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; 退换货政策细则：<br><br>&nbsp;&nbsp;&nbsp;\r\n \r\n以下类别商品自签收7日内，如商品未使用及包装保持出售时原状且配件齐全，我们将提供全款退换货的服务。退换货时，请您务必将保持完好的品牌包装、内带附件、标签、说明书等，如有发票或赠品需同商品一起退回。如商品包装破损或丢失，即便在退换货期内，也无法为您办理（质量问题除外）。我们将自收到退回商品之日起7天内返回您支付的商品价款，退回商品的运费由您承担。<br><br>&nbsp;&nbsp;&nbsp; 1.鞋靴类商品；<br>&nbsp;&nbsp;&nbsp; 2.箱包类商品；<br>&nbsp;&nbsp;&nbsp; 3.服装类商品；<br>&nbsp;&nbsp;&nbsp; 4.家居用品类商品；<br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; 以下类别商品快递公司配送到货后，请当面验货，一旦签收，无质量问题不予退换。<br><br>&nbsp;&nbsp;&nbsp; 1.内衣裤袜类产品；<br>&nbsp;&nbsp;&nbsp; 2.化妆品及个人护理产品； <br>&nbsp;&nbsp;&nbsp; 3.食品保健类商品；<br>&nbsp;&nbsp;&nbsp; 4.数码电器类商品；<br>&nbsp;&nbsp;&nbsp; 5.精品工艺类商品；<br><br><br>网购商品所享受的售后服务，原则上与实体店购物的售后服务一致。建议客人可持商品及购物凭证到环市东店/小象电商outets购物中心的对应专柜处理，实体店接待网购商品的售后服务时，与实体店购买商品的售后服务原则一致。<br><br>&nbsp;&nbsp;&nbsp; 若客人不便亲临商店处理售后事宜，则按以下流程操作。小象电商售后服务中心将为您提供优质、专业的售后服务：<br>&nbsp;&nbsp;&nbsp; （1）商品退换货政策<br>&nbsp;&nbsp;&nbsp; 自商品签收7日内，如商品及包装保持出售时原状且配件齐全，小象电商网上商城提供一次退换货服务。具体品类的退换货政策以《商品退换货政策》细则为准。<br>&nbsp;&nbsp;&nbsp; （2）售后服务流程说明<br>&nbsp;&nbsp;&nbsp; 售后服务包括商品退货、换货、维修、投诉四类。您可以在签收商品7日内，在线提交售后服务申请，填写相应的售后服务要求。收到您的申请后，我们的售后服务人员将与您联系，为您提供个性化贴身的售后服务。<br>&nbsp;&nbsp;&nbsp; （3）售后服务商品维修<br>&nbsp;&nbsp;&nbsp; 在线申请商品维修仅对三包期内小象电商网上商城出售的商品进行故障、损坏的维修。为了给您提供更完善的服务，服装类尺寸修改、数码类产品改装等个性化售后服务，请您带齐相关物品及票据亲临商场，我们将根据您的要求为您服务。<br><br>友情提示：<br><br>&nbsp;&nbsp;&nbsp; 一张订单只为您提供一次退换货服务。请详细阅读《小象电商网上商城退换货政策》细则后与我们联系；<br>&nbsp;&nbsp;&nbsp; 请您确保退换货时，商品吊牌、标签、收货单及各种包装完整，如购买时索要发票，一经退货请将发票随商品一同寄回，丢失或缺损将无法办理退换货；<br>&nbsp;&nbsp;&nbsp; 退换货发生时，请您选择普通快递将商品寄回给我们。因质量问题换货的商品将免费为您配送，礼包或套装中的商品不可以部分退货；如您购买时收到相关赠品，一经退货请将全部赠品一同寄回，并确保赠品包装完整且未使用，如丢失或损坏无法办理退换货。<br>&nbsp;&nbsp;&nbsp;\r\n \r\n若非质量问题商品退换货需要寄回给我们，请根据申请单反馈的提示信息将商品以快递的方式发往小象电商网乐购（拒绝签收需到付的快递包裹）。我们收到包裹后，会对您退回的商品进行检测。如属于商品质量