INSERT INTO `article` VALUES ('10', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>尊敬的用户：<br>年终品牌盛典是公司今年规划的最后一场活动，为保障活动效果，提升销售转化，现规划活动期间发放满199减50元和399减120元券。具体满减券类型、数量及设置要求如下：<br><br>一、发送时间：<br>2017-12-20 14:40:01<br><br>二、发券类型：<br>1、满199减50大服饰通用券<br>2、满399减120大服饰通用券<br>&nbsp;&nbsp; &nbsp;<br>三、券分类、设置使用及承担规则：<br>1、满199减50元券&amp;满399减120元券<br>2、发放渠道：百货各会场、店铺、四级页发放<br>3、发放时间：2017年12月26日0:00:00--2018年1月3日23:59:59<br>4、使用时间：2017年12月26日0:00:00--2018年1月3日23:59:59<br>5、使用地区：全国<br><br>四、商家参与方式<br>满199减50元、399减120元默认服饰券，用券费用由商户自行承担。<br><br>五、商家发货要求<br>顾客享受用券满减的订单，商家必须在48小时内发货(定制、预售类商品除外)。<br><br>六、违规处理<br>活动期间，如发现商户有套券的行为且经调查核实的，将不予结算用券费用，且剔除其参与活动的资格，并保留对商户进行进一步处理的权利。<br><br>七、本活动解释权归本公司所有。</p>', '0', '', '', null, null, null, '公司年终品牌盛典活动发券公告', '2');
INSERT INTO `article` VALUES ('11', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>值此国庆68周年之际,举国同庆,老板电器只有以最实惠、最具性价比的产品来向国庆献礼，我的诚意，你的实惠！<br><br>1、老板恒温热水器，惊爆价899，国庆仅此一家，智能数码显示，V形聚燃智能分段火排，燃烧更充分！真恒温，洗澡更舒服！<br><br>2、老板特价实惠烟灶套餐，999元省钱省到家，双网劲吸，一吸而“净”，搭配不锈钢灶具，精致厨房首选！<br><br>3、经典欧式烟灶套餐，1499国庆限时特别酬宾，纯钢打造！超大风量！尊享静音无烟区！只拼价格不拼爹！<br><br>4、老板高低温消毒柜 799元国庆绝杀，节后涨价没商量，时尚玻璃面板，2星标准，独立双层设计，魅力厨房不可缺。<br><br>5、你没看错，就是399，亏本冲销量，国庆结束马上恢复原价，错过再等一年，老板不锈钢灶具，美观耐用，厨房好帮手。</p>', '0', '', '', null, null, null, '老板电器 国庆放价 只拼价格不拼爹', '2');
INSERT INTO `article` VALUES ('12', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>TCL 超级品牌日！一年只此一次！错过此时，后悔全年！</p><p><br>1、205升节能冰箱 跌破千元，999元限量疯抢，抢到看手气。</p><p><br>2、9公斤大容量洗衣机 999元颠覆你的价值观。</p><p><br>3、398升自除霜十字对开冰箱 每满1000减100，仅1799元。</p><p><br>4、430升风冷无霜对开冰箱 每满1000减100，仅2299元。</p><p><br>5、515升风冷对开冰箱 新品震撼上市，成交价仅2699元，晒单再赠100元话费券。</p><p><br>6、196升风冷无霜三门冰箱 成交价仅1399元，全网不怕比价，再赠“压缩机10年包修”。</p><p><br>7、8.5公斤洗烘一体变频滚筒 成交价仅2399元，双变频静音节能，40分钟极速洗烘。<br><br>一年只此一次！错过此时，后悔全年！</p>', '0', '', '', null, null, null, 'TCL冰洗 每满1000减100', '2');
INSERT INTO `article` VALUES ('13', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>针对双十一大促预热期间，提醒用户提前将商品加入购物车，提前进行商品曝光，并锁定用户，加购用户可在付款日当天享受购物车直降。报名成功的商品，在加购预热期间，商品四级页面将显示“提前加购，11月11日享受**活动价格“。<br><br>一、报名时间：<br>10.20-10.31<br><br>二、报名路径：<br>请联系商城客服人员<br><br>三、加购预热时间：<br>11.01-11.10<br><br>四、爆发付款时间：<br>11.11 00:00—23:59:59<br><br>五注意事项：<br>商品报名成功后，不得在预热期间随意更改商品价格，需保证商品价格不得提前等于加购价格，或者低于加购价格，一经发现将进行商品清退处理。</p>', '0', '', '', null, null, null, '双十一购物节活动', '2');
INSERT INTO `article` VALUES ('14', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>尊敬的用户欢迎您注册成为本网站会员。请用户仔细阅读以下全部内容。如用户不同意本服务条款任意内容，请不要注册或使用本网站服务。如用户通过本网站注册程序，即表示用户与本网站已达成协议，自愿接受本服务条款的所有内容。此后，用户不得以未阅读本服务条款内容作任何形式的抗辩。<br><br>一、服务条款的确认及接受<br>1、本网站各项电子服务的所有权和运作权归属于“本网站”所有，本网站提供的服务将完全按照其发布的服务条款和操作规则严格执行。您确认所有服务条款并完成注册程序时，本协议在您与本网站间成立并发生法律效力，同时您成为本网站正式会员。<br>2、根据国家法律法规变化及本网站运营需要，本网站有权对本协议条款及相关规则不时地进行修改，修改后的内容一旦以任何形式公布在本网站上即生效，并取代此前相关内容，您应不时关注本网站公告、提示信息及协议、规则等相关内容的变动。您知悉并确认，如您不同意更新后的内容，应立即停止使用本网站；如您继续使用本网站，即视为知悉变动内容并同意接受。<br><br>二、服务需知<br>1、本网站运用自身开发的操作系统通过国际互联网络为用户提供购买商品等服务。使用本网站，您必须：<br>(1)、自行配备上网的所需设备，包括个人手机、平板电脑、调制解调器、路由器等；<br>(2)、自行负担个人上网所支付的与此服务有关的电话费用、网络费用等；<br>2、基于本网站所提供的网络服务的重要性，您确认并同意：<br>(1)、提供的注册资料真实、准确、完整、合法有效，注册资料如有变动的，应及时更新；<br>(2)、如果您提供的注册资料不合法、不真实、不准确、不详尽的，您需承担因此引起的相应责任及后果，并且本网站保留终止您使用本网站各项服务的权利。<br><br>三、订单<br>1、使用本网站下订单，您应具备购买相关商品的权利能力和行为能力，如果您在18周岁以下，您需要在父母或监护人的监护参与下才能使用本网站。在下订单的同时，即视为您满足上述条件，并对您在订单中提供的所有信息的真实性负责。<br>2、在您下订单时，请您仔细确认所购商品的名称、价格、数量、型号、规格、尺寸、联系地址、电话、收货人等信息。收货人与您本人不一致的，收货人的行为和意思表示视为您的行为和意思表示，您应对收货人的行为及意思表示的法律后果承担连带责任。<br>3、您理解并同意：本网站上销售商展示的商品和价格等信息仅仅是要约邀请，您下单时须填写您希望购买的商品数量、价款及支付方式、收货人、联系方式、收货地址等内容；系统生成的订单信息是计算机信息系统根据您填写的内容自动生成的数据。<br>4、本网站会做出最大的努力，但由于市场变化及各种以合理商业努力难以控制因素的影响，本网站无法避免您提交的订单信息中的商品出现缺货情况；如您下单所购买的商品发生缺货，您有权取消订单，本网站亦有权自行取消订单，若您已经付款，则为您办理退款。<br><br>四、配送<br>1、您在本网站购买的商品将按照本网站上您所指定的送货地址进行配送。。您应当清楚准确地填写您的送货地址、联系人及联系方式等配送信息，您知悉并确认，您所购买的商品应仅由您填写的联系人接受身份查验后接收商品，因您变更联系人或相关配送信息而造成的损失由您自行承担。<br>2、因如下情况造成订单延迟或无法配送等，本网站将无法承担迟延配送的责任：<br>(1)、客户提供错误信息和不详细的地址；<br>(2)、货物送达无人签收，由此造成的重复配送所产生的费用及相关的后果。<br>(3)、不可抗力，例如：自然灾害、交通戒严、突发战争等。<br><br>五、用户个人信息保护及授权<br>1、您知悉并同意，为方便您使用本网站相关服务，本网站将存储您在使用时的必要信息，包括但不限于您的真实姓名、性别、生日、配送地址、联系方式、通讯录、相册、日历、定位信息等。除法律法规规定的情形外，未经您的许可本网站不会向第三方公开、透露您的个人信息。<br>2、您知悉并确认，若您提供的信息不真实、不完整，则无法使用本网站或在使用过程中受到限制，同时，由此产生的不利后果，由您自行承担。<br>3、您充分理解并同意：<br>(1)、接收通过邮件、短信、电话等形式，向在本网站注册、购物的会员、收货人发送的订单信息、促销活动等内容；<br>(2)、为配合行政监管机关、司法机关执行工作，在法律规定范围内本网站有权向上述行政、司法机关提供您在使用本网站时所储存的相关信息，包括但不限于您的注册信息等，或使用相关信息进行证据保全，包括但不限于公证、见证等；<br>(3)、本网站有权根据实际情况，在法律规定范围内自行决定用户在本网站及服务中数据的最长储存期限以及用户日志的储存期限，并在服务器上为其分配数据最大存储空间等。<br><br>六、用户行为规范<br>1、本协议依据国家相关法律法规规章制定，您同意严格遵守以下义务：<br>(1)、不得传输或发表：煽动抗拒、破坏宪法和法律、行政法规实施的言论，煽动颠覆国家政权，推翻社会主义制度的言论，煽动分裂国家、破坏国家统一的言论，煽动民族仇恨、民族歧视、破坏民族团结的言论；<br>(2)、从中国大陆向境外传输资料信息时必须符合中国有关法规；<br>(3)、不得利用本网站从事洗钱、窃取商业秘密、窃取个人信息等违法犯罪活动；<br>(4)、不得干扰本网站的正常运转，不得侵入本网站及国家计算机信息系统；<br>(5)、不得传输或发表任何违法犯罪的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、伤害性的、庸俗的，淫秽的、不文明的等信息资料；<br>(6)、不得传输或发表损害国家社会公共利益和涉及国家安全的信息资料或言论；<br>(7)、不得教唆他人从事本条所禁止的行为；<br>(8)、不得利用在本网站注册的账户进行牟利性经营活动；<br>(9)、不得发布任何侵犯他人隐私、个人信息、著作权、商标权等知识产权或合法权利的内容；<br>2、您须对自己在网上的言论和行为承担法律责任，您若在本网站上散布和传播反动、色情或其它违反国家法律的信息，本网站的系统记录有可能作为您违反法律的证据。<br><br>七、违约责任<br>1、如果本网站发现或收到他人举报投诉您违反本协议约定的，本网站有权不经通知随时对相关内容进行删除、屏蔽，并视行为情节对违规帐号处以包括但不限于警告、限制或禁止使用部分或全部功能、帐号封禁直至注销的处罚，并公告处理结果。<br>2、本网站有权依据合理判断对违反有关法律法规或本协议规定的行为采取适当的法律行动，并依据法律法规保存有关信息向有关部门报告等，您应独自承担由此而产生的一切法律责任。<br>3、您理解并同意，因您违反本协议或相关服务条款的规定，导致或产生第三方主张的任何索赔、要求或损失，您应当独立承担责任；本网站因此遭受损失的，您也应当一并赔偿。<br>4、除非另有明确的书面说明,本网站不对本网站的运营及其包含在本网站上的信息、内容、材料、产品（包括软件）或服务作任何形式的、明示或默示的声明或担保（根据中华人民共和国法律另有规定的以外）。<br><br>八、所有权及知识产权<br>1、您一旦接受本协议，即表明您主动将您在任何时间段在本网站发表的任何形式的信息内容（包括但不限于客户评价、客户咨询、各类话题文章等信息内容）的财产性权利等任何可转让的权利，如著作权财产权（包括并不限于：复制权、发行权、出租权、展览权、表演权、放映权、广播权、信息网络传播权、摄制权、改编权、翻译权、汇编权以及应当由著作权人享有的其他可转让权利），全部独家且不可撤销地转让给本网站所有，并且您同意本网站有权就任何主体侵权而单独提起诉讼。<br>2、本协议已经构成《中华人民共和国著作权法》第二十五条及相关法律规定的著作财产权等权利转让书面协议，其效力及于您在本网站软件上发布的任何受著作权法保护的作品内容，无论该等内容形成于本协议订立前还是本协议订立后。<br>3、您同意并已充分了解本协议的条款，承诺不将已发表于本网站的信息，以任何形式发布或授权其它主体以任何方式使用（包括但不限于在各类网站、媒体上使用）。<br>4、除法律另有强制性规定外，未经本网站明确的特别书面许可,任何单位或个人不得以任何方式非法地全部或部分复制、转载、引用、链接、抓取或以其他方式使用本网站的信息内容，否则，本网站有权追究其法律责任。<br>5、本网站所刊登的资料信息（诸如文字、图表、标识、按钮图标、图像、声音文件片段、数字下载、数据编辑和软件），均是本网站或其内容提供者的财产，受中国和国际版权法的保护。本网站上所有内容的汇编是本网站的排他财产，受中国和国际版权法的保护。本网站上所有软件都是本网站或其关联公司或其软件供应商的财产，受中国和国际版权法的保护。<br><br>九、法律管辖适用及其他<br>1、本协议的订立、执行和解释及争议的解决均应适用中国法律。如双方就本协议内容或其执行发生任何争议，双方应尽力友好协商解决；协商不成时，任何一方均可向协议签订地人民法院提起诉讼。<br>2、如果本协议中任何一条被视为废止、无效或因任何理由不可执行，该条应视为可分的且并不影响任何其余条款的有效性和可执行性。<br>3、本协议未明示授权的其他权利仍由本网站保留，您在行使这些权利时须另外取得本网站的书面许可。本网站如果未行使前述任何权利，并不构成对该权利的放弃。<br>4、您点击“同意”按钮即视为您完全接受本协议，在点击之前请您再次确认已知悉并完全理解本协议的全部内容。</p>', '0', '', '', null, null, null, '会员注册协议', '3');
INSERT INTO `article` VALUES ('15', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>1、注册/登录<br>登录商城账号，如果您还没有商城账户，请点击“注册”。<br><br>2、选购商品<br>分类浏览或直接搜索查找商品。<br><br>3、加入购物车<br>商品加入购物车去结算或者继续购物。<br><br>4、去结算<br>点击去结算按钮，进入订单信息页面，确认您的收货地址、联系方式、支付方式、配送方式、发票信息。<br><br>5、提交订单<br>确认无误，提交订单，完成支付。<br><br>6、查看订单<br>在“我的订单”页面，查看订单状态，了解商品配送流程。<br><br>7、确认收货<br>确认收货，参与商品评价互动。</p>', '0', '', '', null, null, null, '购物流程', '3');
INSERT INTO `article` VALUES ('16', '2018-10-28 00:00:00', '2020-09-30 02:03:46', '2', '小象电商网乐购', '<p>1、首先打开商城网站；<br>2、打开页面后，在页面顶部的左侧位置有一个“注册”按钮；<br>3、点击“注册”按钮，会跳转到注册页面；<br>4、根据注册页面所求填写注册信息，点击“注册”提交按钮；<br>5、点击注册后，显示注册成功；</p>', '0', '', '', null, null, null, '免费注册', '3');
INSERT INTO `article` VALUES ('17', '2018-10-28 00:00:00', '2020-10-03 01:39:28', '1', '小象电商网乐购', '<p><br><br>一、 会员特权<br><br><br>（一）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 小象电商VIP卡是小象电商推出的微信端会员卡，成功激活，可在小象电商“网乐购”和小象电商实体商店使用。<br><br><br>（二）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在实体店购物时，出示VIP卡可获得积分，并享受正价商品的折扣优惠。<br><br><br>（三）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 累积的购物奖励积分可参加积分兑换。<br><br><br>（四）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; VIP卡积分余额达到3000分时将自动升级为VIP金卡，享受VIP金卡的优惠折扣及礼遇。<br><br><br>（五）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 享受终身会员资格。<br><br><br>&nbsp;<br><br><br>二、 申请程序<br><br><br>关注“小象电商”微信服务号，进入“友会员”——“会员卡申领/绑定”——“点击开卡”——选择“办理新的VIP卡”，按提示输入有关资料，通过验证即可激活。<br><br><br><br><br></p>', '0', '', '', null, null, null, '申领会员卡', '3');
INSERT INTO `article` VALUES ('18', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>1、忘记账户或昵称怎么办？<br>若您忘记账户或昵称，请联系客服人员为您处理。<br><br>2、如何修改登陆密码？<br>进入会员中心，进入“个人资料 - 修改密码”，根据引导即可完成密码修改。</p>', '0', '', '', null, null, null, '常见问题', '3');
INSERT INTO `article` VALUES ('19', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>本商城在全国大部分城市中开通了货到付款服务。<br><br>您可选择现金、POS机刷卡、支票的方式支付货款：<br>1、POS机刷卡：目前仅支持带有银联标识的银行卡，信用卡POS机刷卡消费赠送积分以各银行为准，具体信息请致电发卡行确认;<br>2、若您下单时在订单中填写POS机刷卡，支付时也可换成现金支付;<br>3、支票支付：需要您将支票内容填写完整且需要款到账后方可送货，目前仅北京、上海两地客户可使用此服务，其余区域暂不支持支票支付;<br>4、本商城快递配送时可支持现金、POS机刷卡、支票支付(仅限北京、上海两个地区);</p><p></p>', '0', '', '', null, null, null, '货到付款', '4');
INSERT INTO `article` VALUES ('20', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>目前商城支持多家银行网银支付，请及时使用网银支付，订单24小时内有效，逾期系统将自动取消，为保证每个顾客均有公平购买的机会，在您实际完成全部金额支付前网站不提供价格、库存保护，因工厂调价、促销结束、抢购等造成的价格、库存变化以付款时为准。<br><br>目前商城支持招商银行、中国银行、交通银行、工商银行、建设银行、农业银行、兴业银行等多家银行网银支付功能。当您提交订单之后，点击去网银支付，系统会自动转向您指定的银行支付页面。<br><br>过期系统将自动取消，请进入“我的订单”查询订单状态。如您仍需购买，请您重新下订单并支付。</p>', '0', '', '', null, null, null, '网银支付', '4');
INSERT INTO `article` VALUES ('21', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>一、如何开通银行卡<br>因各地银行政策不同，建议您在网上支付前拨打所在地银行电话，咨询该行可供网上支付的银行卡种类及开通手续。<br>银行名称 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 服务热线 &nbsp;&nbsp; &nbsp;<br>招商银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95555 &nbsp;&nbsp; &nbsp;<br>中国银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95566 &nbsp;&nbsp; &nbsp;<br>交通银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95559<br>北京银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 96169 &nbsp;&nbsp; &nbsp;<br>光大银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95595<br>中国邮政 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95580<br>民生银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95568 &nbsp;&nbsp; &nbsp;<br>华夏银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95577 &nbsp;&nbsp; &nbsp;<br>中信银行 &nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95558<br>中国工商银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95588<br>中国建设银行&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp; 95533 &nbsp;&nbsp; &nbsp;<br>中国农业银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95599 &nbsp;&nbsp; &nbsp;<br>深圳发展银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95501<br>上海浦东发展银行 95528 &nbsp;&nbsp; &nbsp;<br>广东发展银行&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 95508 <br><br>二、支付金额上限是多少？<br>目前各银行对于网上支付均有一定金额的限制，由于各银行政策不同，建议您在申请网上支付功能时向银行咨询相关事宜。<br>&nbsp;<br>三、我怎样判断网上支付是否成功？<br>1、当您完成网上在线支付过程后，系统应提示支付成功；如果系统没有提示支付失败或成功，您可通过电话、ATM 、柜台或登录网上银行等各种方式查询银行卡余额，如果款项已被扣除，说明您已支付成功。<br>2、如果出现信用卡超额透支、存折余额不足、意外断线等导致支付不成功，请您登录我买网在“我的帐户”页面里“我的订单”下寻找未支付成功的订单，重新完成支付。<br>&nbsp;<br>四、造成“支付被拒绝”的原因有哪些？<br>1、所持银行卡尚未开通网上在线支付功能。<br>2、所持银行卡已过期、作废、挂失。<br>3、所持银行卡内余额不足。<br>4、输入银行卡卡号或密码不符。<br>5、输入证件号不符。<br>6、银行系统数据传输出现异常。<br>7、网络中断。</p>', '0', '', '', null, null, null, '银行转帐', '4');
INSERT INTO `article` VALUES ('22', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>1、商城及商家订单均不存在卡单、失效等情况。<br>2、客服人员不会通过私人手机号码、400电话和前缀带有“+”、“0”或含“()”等类型的号码，告之您订单异常，也不会引导您ATM转账、QQ提供退款链接等操作。<br>3、订单实际状态请以会员中心-我的订单页面中的交易状态为准。<br>4、商城网址是www.小象SHOP.net，骗子使用的诈骗链接中会刻意添加、修改商城的url地址，对于这些细微的变动，请您一定要自行辨认，谨防上当受骗。</p>', '0', '', '', null, null, null, '账户安全', '4');
INSERT INTO `article` VALUES ('23', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>以顾客在网页下单具体选择区域为准。</p>', '0', '', '', null, null, null, '配送范围', '5');
INSERT INTO `article` VALUES ('24', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>一、自营商品运费规则<br>1、订单金额小于49元，则需每单承担3元基础运费；满49元则免基础运费，不收续重运费。<br>2、订单中的生鲜商品和非生鲜商品，分别计算金额、运费，互不参与运费凑单；订单总计应收运费等于订单中的生鲜商品应付运费与非生鲜商品应付运费之和。<br><br>二、第三方卖家商品运费规则<br>用户购买入驻本商城的第三方卖家商品，则按卖家在商品详情页公示的运费标准收取，不同的卖家店铺收取的标准各异，一般存在情形如下：<br>1、同一店铺内商品，每单固定运费；<br>2、同一店铺内商品，每单满一定金额免运费，不满则收取一定运费；<br>3、按订单中不同商品类型分别收取运费；<br>4、部分店铺商品参与自营商品免运费凑单，具体收取费用以提交订单时的运费信息为准；<br>5、其他由卖家公示的运费标准。<br><br>三、特别说明<br>1、订单金额为减去优惠促销的金额。<br>2、订单中非生鲜商品金额为单笔订单中消费者就非生鲜商品实付的金额；订单中生鲜商品金额为单笔订单中消费者就生鲜商品实付的金额。<br>3、商品重量以毛重计算（含商品销售包装的重量）。<br>4、中小件商品与大件商品的划分由自营销售商自行确认，商品所应支付的运费以提交订单时的运费信息为准。<br>5、运费的收取标准可能进行相应调整，具体以商品详情页及结算页公示的运费为准。</p>', '0', '', '', null, null, null, '配送费用', '5');
INSERT INTO `article` VALUES ('25', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>商城自营普通快递送货上门和平邮订单：钻石会员单张订单满49元包邮，其他会员单张订单满59元包邮，不符合以上免运费标准的，每单收取5元运费。</p><p></p>', '0', '', '', null, null, null, '免邮说明', '5');
INSERT INTO `article` VALUES ('26', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>为保障您的权益，请您在收到商品时与配送员当面核对，核对范围包括但不限于：商品种类、规格、数量(包括商品最小包装单位)、金额、赠品、外包装、票据等是否与订单一致，准确无误再进行签收。签收后，本商城不再为以上问题负责。<br><br>根据不同食品的不同属性，在验货时您可能需要一并检查以下所列举情况中的一个或多个方面，包括但不限于：商品的保质期、商品的性状是否变化、商品本身标识是否可辨、商品的防伪标签是否已被完全刮开等。<br><br>如果您在签收前已确认上述问题无误，请您在本商城发货单上签字确认。如果您的订单交由他人代收，代收人享有与您等同的权利，我们将视为您本人签收。如果您在验货时发现商品存在上述问题，经配送员或配送员在场时与客服联络确认，可以选择拒收整个订单。但如果订单商品含有密封包装，且拆封后无质量问题时，不可拒收。<br><br>拒收业务完成后，已支付的款项将按原支付方式和原路径安排退款。对于本商城原因造成的订单拒收，客户无需支付配送费；客户原因造成的订单拒收，本商城将收取您的单程配送费。</p>', '0', '', '', null, null, null, '验货与签收', '5');
INSERT INTO `article` VALUES ('27', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>进入会员中心，进入“我的订单 - 查看订单”，即可查询订单状态。</p>', '0', '', '', null, null, null, '订单查询', '6');
INSERT INTO `article` VALUES ('28', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>如果您选择“网上支付”和“银行转账”这两种付款方式，商城在暂未收到您款项时，订单会显示“等待到款”，建议您在订单保留期限内及时付款。</p>', '0', '', '', null, null, null, '订单支付', '6');
INSERT INTO `article` VALUES ('29', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>订单提交成功后，您可取消商城自营商品订单及部分第三方卖家出售的商品订单。<br><br>注：订单取消申请一旦提交成功，将无法进行任何修改或恢复，请您谨慎操作。<br>1、提交订单取消申请后，系统会确认包裹位置，拦截成功之后会为您办理退款。若订单取消失败，订单会继续为您配送，您可根据需要签收或拒收。<br>2、订单若包含赠品、活动、优惠券等促销活动商品，若主商品订单取消，关联促销商品也将取消。<br>3、已确认收货的订单，请申请返修/退换货。</p><p></p>', '0', '', '', null, null, null, '取消订单', '6');
INSERT INTO `article` VALUES ('30', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>在订单审核之前可以修改订单，若订单已审核则订单无法修改。<br><br>注意事宜<br>1、修改订单可能影响送货时间。<br>2、修改时将以当前商品信息为准，修改时需要注意查看活动信息。<br>3、由于订单生产速度快，可能出现修改不成功的情况。</p>', '0', '', '', null, null, null, '修改订单', '6');
INSERT INTO `article` VALUES ('31', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>若客户发现商品存在质量问题应立即停止使用，自货物签收之日起48小时内可直接与商城客服中心取得联系。经检测确属质量问题的，客户可以选择换货，本商城将提供与原商品同规格同数量的新品进行更换。<br><br>一、存在以下情形之一的，“商城”不承担换货责任<br>1、任何非购自商城商品。<br>2、任何因客户使用或保管不当导致出现包装破损或质量问题的商品。<br>3、任何因客户原因导致超过保质期的商品。</p>', '0', '', '', null, null, null, '退换货政策', '7');
INSERT INTO `article` VALUES ('32', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>1、自货物签收后48小时内，若客户发现商品存在质量问题，请与客服中心联系确认。<br>2、客服中心在受理您的退货申请后一周内安排上门处理，遇特殊情形需延期处理的将会提前通知。<br>3、符合退货条件的，客服中心予以确认，并按原支付方式和原路径安排退款。在线支付的订单，我们会在15个工作日内将退款注入至原支付账户。汇款支付的订单，将退款汇至原汇款银行的原汇款人处。货到付款的订单，以现金形式返还。</p>', '0', '', '', null, null, null, '退换货流程', '7');
INSERT INTO `article` VALUES ('33', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>一、若商品存在问题，可以操作进行退换货操作<br>1、自货物签收之日起48小时内，若客户发现商品存在质量问题，请与客服中心联系确认。<br>2、客服中心在受理您的换货申请后一周内安排上门处理，遇特殊情形需延期处理的将会提前通知。<br><br>二、存在以下情形之一的，商城不承担退换货责任<br>1、任何非购自本商城的商品。<br>2、任何因客户使用或保管不当导致出现质量问题的商品。<br>3、任何因客户原因导致超过保质期的商品。<br>4、仅赠品存在问题，且不影响主要商品使用或食用的。</p><p></p>', '0', '', '', null, null, null, '退换货申请', '7');
INSERT INTO `article` VALUES ('34', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>一、退款方式<br>1、页面申请：您可以在“我的订单-退换货申请”中申请退货成功后，商城将按原支付方式原路退回。<br>2、与客服联系：若因异常状态导致退款失败，请联系客服协助为您办理退款事宜。<br><br>二、退款说明<br>1、预存款退款：我们将您的货款直接退至您的账户余额，方便您下次购物时再次使用。<br>2、银行卡退款：我们将您的货款退至您支付时使用的银行卡账户，其中货到付款现金支付需要您提供准确的银行卡。<br>3、账户信息【包括持卡人姓名、银行卡号、开户行名称（5万元以下的退款需精确到支行）】，方便我们尽快给您打款。</p><p></p>', '0', '', '', null, null, null, '退款说明', '7');
INSERT INTO `article` VALUES ('35', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>尊敬的用户欢迎您入驻成为本网站商家。请商家用户仔细阅读以下全部内容。如商家用户不同意本服务条款任意内容，请不要注册或使用本网站服务。如商家用户通过本网站注册程序，即表示商家用户与本网站已达成协议，自愿接受本服务条款的所有内容。此后，商家用户不得以未阅读本服务条款内容作任何形式的抗辩。<br><br>一、概述<br>1、本协议适用于本网站开放平台商家，商家可以根据业务需求选择经营模式以通过本网站开放平台向消费者销售商品或提供服务。本规则不适用于本网站自营商品及信息。<br>2、为了促进平等、开放、透明的平台生态的搭建，根据《本网站商家入驻协议》等服务制定本规则。<br>3、本网站开放平台总则，是对本网站商家增加基本义务或规范商家行使基本权利的条款。<br>4、违规行为的认定与处理，本网站将基于法律法规的规定、协议的约定、消费者和商家提供的证据材料以及平台记录的相关信息等做出判断并依据相关规则严格执行。本网站商家在适用规则上一律平等。<br>5、商家应遵守国家法律、行政法规、部门规章等规范性文件。对任何涉嫌违反国家法律、行政法规、部门规章等规范性文件的行为，本规则已有规定的，适用本规则；本规则尚无规定的，本网站有权依据相应规则酌情处理，但本网站对商家的处理不免除商家因违法、违约等行为应承担的法律责任。<br>6、商家在本网站的任何行为，应同时遵守与本网站所签订的各项协议。<br>7、本网站有权随时变更本规则并在规则平台或商家管理系统等渠道予以公告。若商家不同意相关变更，应立即停止使用本网站开放平台提供的相关服务，并及时通知本网站。本网站有权对商家行为及应适用的规则/协议约定进行单方认定，并据此处理。<br><br>二、入驻<br>1、商家应当严格遵守本网站系统设置的入驻流程完成注册，并严格遵守《本网站商家入驻协议》的规定。商城在选择用户名时须遵守国家法律法规，不得包含违法或涉嫌侵犯他人权利等的相关信息。<br>2、用户必须满足以下条件，才有权申请加入本网站，成为商家：<br>(1)、商家应符合《本网站商家入驻协议标准》；<br>(2)、商家及其销售的商品或提供的服务应符合本网站开放平台对商品质量的相关要求；<br>(3)、商家有效签署《本网站商家入驻协议》并承诺遵守平台全部规则要求；<br>(4)、商家需按照开通类目的资费标准缴纳各项费用；<br>(5)、商家满足本网站开放平台要求的其他条件；<br><br>三、经营<br>1、商家申请店铺名等信息时，应须遵守国家法律法规及开放平台相关规则，不得包含违法或涉嫌侵犯他人权利等的相关信息；<br>2、商家上传的店铺信息（包括店标、店铺名称、店铺介绍、店铺广告等）内容设置需真实、有效且与注册信息一致；<br>3、商家应及时缴存及补缴保证金；<br>4、商家应保证在本网站开放平台售卖的商品为正品或其他原创非侵权商品；<br>5、商家应按照本网站开放平台系统设置的流程的要求发布商品/服务；<br>6、商家不得编辑及发布国家法律法规或本网站规定的禁止发布的商品；<br>7、“商品如实描述”及对其所售商品/服务质量承担保证责任是商家的基本义务。“商品如实描述”是指商家在商品介绍页面、店铺<br>页面等所有本网站开放平台提供的渠道中，应当对其所发布商品的基本属性、成色、瑕疵等必须说明的信息进行真实、完整的描述。<br>8、商家应保证其出售的商品在合理期限内可以正常使用、提供的服务符合承诺标准，包括商品不存在危及人身财产安全的不合理危险、具备商品应当具备的使用性能、符合商品或其包装上注明采用的标准、符合提供服务时承诺的标准，且承诺标准不低于国家/行业标准等。本网站有权对商家经营的商品按照各品类抽检规范进行抽检。<br>9、参加本网站开放平台营销活动时，商家须遵守本网站营销活动规则。<br>10、商家应遵守本网站发货管理规则的相关要求，在规定/承诺时效内完成发货及揽收。<br>11、商家可以根据自身需求选择本网站供应链管理服务，详细服务内容及要求以双方签订的《仓储服务合同》为准。<br>12、商家应遵守本网站制定的商家售后服务管理规则，向消费者履行售后服务义务；<br>13、本网站有权对本网站介入的交易纠纷进行处理；<br>14、商家应遵守本网站评价管理规则对评价进行维护及管理。<br><br>四、终止合作<br>1、店铺服务期届满，商家未完成下一年度续签或未到店铺服务结束日期，商家提前关店的，视为商家主动终止合作。商家主动终止合作，保证金按约定进行退还，提前关店的情形，平台使用费不进行退还。<br>2、若商家发生以下任一情形，本网站有权进行清退：<br>(1)、存在恶意竞争、影响消费者权益、影响本网站平台声誉等违反市场公平竞争原则、诚实信用原则、公序良俗的行为；<br>(2)、通过不正当手段使用本网站注册LOGO、域名等用于不正当宣传、商业活动，给消费者造成误导、侵犯本网站知识产权等给本网站造成不良影响的的行为；<br>(3)、在线上、线下等渠道，通过文字或图片等方式发布恶意诋毁、故意矮化本网站的言论，给本网站造成不良影响的行为；<br>(4)、商家违反《本网站商家入驻协议》的行为；<br>(5)、商家经营的品牌对他人商标、商品名称、包装和装潢、企业名称、产品质量标志等构成仿冒或容易造成消费者混淆、误认的；<br>3、以上情形，本网站除有权清退商家、终止与其合作外，另可向商家追究其法律责任。本网站将按照合同约定及规则办理店铺关闭手续，并按约定情形办理保证金的退还。<br><br>五、市场管理<br>1、为了提升消费者的购物体验，维持市场正常运营秩序，本网站有权按照本规则规定的情形对商家经营行为采取以下管理措施：<br>(1)、警告：指本网站通过口头或书面的形式对商家的不当行为进行提醒和告诫；<br>(2)、商品下架：指将商家在售商品/服务转移至线上待售商品；<br>限制参加营销活动：指限制商家参加本网站官方发起的营销活动；<br>(3)、删除商品：是指删除已发布的商品；<br>(4)、删除信息：是指删除店铺、商品、活动页等位置的信息；<br>(5)、关闭店铺：指停用商家的店铺，下架店铺内所有出售中的商品，禁止发布商品，并禁止创建店铺；<br>2、商家应积极提升自身经营水平，为消费者提供优质的商品及服务。<br>3、商家如发生危及交易安全或扰乱本网站运营秩序等行为，本网站将依照其行为的危险程度采取市场管控措施。且本网站有权依照平台规则采取违规处理并要求商家承担违约责任。<br>4、新闻媒体曝光或国家行政部门通报的质量不合格的品牌、品类或批次的商品，或其他要求协查的商品及店铺及本网站抽检发现问题的商品相关联的商品，本网站将依照其情形严重程度对相关商家的店铺及商品采取商品下架、商品删除等市场管理措施。<br>5、因商家行为引发司法诉讼的，若商家存在提供的联系方式无效、消极应对或继续违规等情形，对平台造成或可能造成实际损失或不良影响的，本网站将根据产生或可能产生后果的严重程度采取市场管理措施。<br>6、商家应根据协议约定或规则规定缴纳及补足保证金。若保证金余额不足或被本网站通知需要增加保证金时，且经本网站催缴后商家未按协议约定期限缴纳或补足的，本网站有权视违约情况采取管理措施，直至商家足额缴纳为止。<br>7、商家发生违规行为的，其违规行为应当及时纠正，本网站开放平台将根据事实证据按对商家进行违规行为管理。<br>8、本网站通过其他商家、权利人等的投诉或本网站排查等方式发现商家的违规行为。<br>9、商家自行做出的承诺或说明与本规则相悖的，该承诺或说明将不作为本网站处理违规申诉的依据。除证据有误或判断错误的情形外，本网站不终止或撤销对违规行为的处理。<br><br>六、附则<br>1、本网站开放平台商家的行为，发生在本管理规则生效之日以前的，适用当时的规则。发生在本管理规则生效之日以后的，适用本规则。<br>2、本网站可根据平台运营情况随时调整本管理规则。<br>3、商家应遵守国家法律、行政法规、部门规章等规范性文件。对任何涉嫌违反国家法律、行政法规、部门规章等规范性文件的行为，本规则已有规定的，适用于本规则。本规则尚无规定的，本网站有权酌情处理。但本网站对商家的处理不免除其应承担的法律责任。商家在本网站的任何行为，应同时遵守与本网站及其关联公司签订的各项协议。</p>', '0', '', '', null, null, null, '商家入驻协议', '8');
INSERT INTO `article` VALUES ('36', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>商家入驻标准<br>1、商城暂不接受个体工商户的入驻申请，商家须为正式注册企业，也不接受非中国大陆企业的入驻申请。<br>2、商家必须给消费者提供正规发票，发票盖章的公司名称必须与商家与合作的公司名称一致。<br>3、商家必须为所经营商品的品牌方，或提供品牌销售授权证明、代理授权书。<br>4、拥有基本电商运营团队，具备完善的能力和售后服务能力。<br>5、商城有权根据包括但不仅限于品牌需求、公司经营状况、服务水平等其他因素退回商家申请；同时商城有权在申请入驻及后续经营阶段要求商家提供其他资质；商城将结合各行业发展动态、国家相关规定及消费者购买需求，不定期更新招商标准。</p>', '0', '', '', null, null, null, '商家入驻', '8');
INSERT INTO `article` VALUES ('37', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>一、入驻所需材料<br>1、营业执照副本：需完成有效年检且所售商品属于经营范围内。<br>2、税务登记证副本：国税、地税均可，优先上传盖有国税局印章的税务登记证。<br>3、组织机构代码证副本：织机构代码证必须要年检，年检要求同营业执照年检要求一致，如果出现当地政策规定不定期（非正常年度）年检的情况，需出具政府发文文件的复印件并加盖供应商公章。<br>4、一般纳税人资质证明：扫描件一般纳税人证书如果纳税人在辅导期的，需出具我司模板的“辅导期商函”，模板。<br>5、法人身份证：正反面扫描件。<br><br>二、开票限额证明函<br>1、原则上开票限额证明函为：税务部门出具的“开票限额审批表”，即为供应商在取得税务登记证后，申请开票时税务机关出具的审批证明，“开票限额审批表”须附有税务局盖章。<br>2、如“开票限额审批表”遗失无法提供，可由供应商所在地的税务机关出具相关信息证明，具体模版不限，但证明中必须明确开票限额，且加盖当地税务章。<br>3、以上均无法提供，可由供应商执金税卡进入金税系统打印出的开票限额信息。<br><br>三、品牌资质需在有效期内<br>1、自有品牌：上传商标注册证或者注册申请受理通知书(若办理过变更、转让、续展，请一并提供商标总局颁发的变更、转让、续展证明)。<br>2、商标注册证或商标注册申请受理通知书复印件。<br>3、各级的正规品牌授权文件，若上一级的授权方或供货商为自然人，则需同时提供其亲笔签名的身份证复印件。</p>', '0', '', '', null, null, null, '商家帮助', '8');
INSERT INTO `article` VALUES ('38', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>一、进口商品<br>1、如经营进口商品，仅须提交该品牌近一年内中华人民共和国海关进口货物报关单复印件。<br><br>二、以下产品需提供检测报告（每个品牌须至少提供一份由第三方权威机构出具的检测报告，成品检测报告内容须包含品牌名称、产品名称和各类产品对应的下述必检项目），必要检测项要求如下：<br>1、男女装/文胸/塑身服/童装/孕妇装/袜子：成分含量、GB18401全套、标识标志。<br>2、三岁以下婴幼儿服装类：成分含量、GB18401全套、标识标志、外观质量、耐唾液色牢度。<br>3、家居服/保暖内衣：成分含量、GB18401全套、标识标志、外观质量、水洗尺寸变化率。<br>4、羽绒服装：成分含量、GB18401全套、标识标志、外观质量、含绒量、充绒量、种类鉴定。<br>5、皮革/皮草类服饰：摩擦色牢度（仅皮革）、皮革撕裂力（仅皮革）、甲醛含量、可分解芳香胺染料、标识标志、外观质量、材质鉴定。<br>6、针织衫：成分含量、GB18401全套、标识标志、水洗尺寸变化率。<br>7、手套/领带/领结/帽子/手帕/围巾/丝巾/披肩/布面料/毛线:GB18401全套，以及标识标志。<br><br>三、注意事项<br>1、GB18401全套包括：耐水色牢度、耐汗渍色牢度、耐干摩擦色牢度、甲醛、PH值、异味、可分解芳香胺染料。<br>2、有填充物的产品（除羽绒）需加检“原料要求”，皮革类（鞋服、皮带、手套）需加检“材质鉴定”。<br>3、种类鉴定，主要指“鹅鸭绒种类鉴定”。<br>4、服饰类目跨鞋类箱包、家纺、母婴童装等类目，需同时提供跨类目产品的检测报告（由第三方权威检测机构出具）。</p>', '0', '', '', null, null, null, '运营服务', '8');
INSERT INTO `article` VALUES ('39', '2018-10-28 00:00:00', '2018-10-28 00:00:00', '0', '小象电商网乐购', '<p>交易争议处理规范<br>一、总则<br>1、为构建商城开放、透明、诚信、尽责的经营环境，明确存在争议的交易款项归属或资金赔偿，保障商城上买家和商家在交易中的合法权益，依据《中华人民共和国合同法》、《消费者权益保护法》、《网络交易管理办法》等相关法律法规以及商城《商家管理规范总则》，制定本规范。<br>2、商城争议处理规范，是买家和商家不可撤销地授权商城基于相关法律法规、商城《商家管理规范总则》以及自己的判断，作为独立第三方，对买卖双方存在争议的交易款项归属或资金赔偿做出处理的基本程序与标准。<br>3、商城将基于法律法规、平台规则及普通人的判断，根据本规范的规定对买卖双方的争议做出处理。商城并非司法机关，对凭证/证据的鉴别能力及对争议的处理能力有限，商城不保证争议处理结果符合买家和(或)商家的期望，也不对依据本规范做出的争议处理结果承担任何责任。<br>4、处理争议期间，商城通过商城在线客服系统、电子邮件、短信或电话等方式向买卖双方发送的与争议处理相关的提示或通知，构成本规范的有效组成部分。<br>5、商城有权随时变更本规范并在网站上予以公告。买家和（或）商家不同意相关变更的，可自行协商或通过其他途径解决争议。<br>6、买家与商家应当严格遵守国家法律法规，对于本规则已有的规定，买家与商家争议适用于本规范，本规范尚无规定的，商城有权依据法律法规及一般规律酌情处理。商城对于当事人的处罚，不免除其应承担的法律责任及赔偿义务。商城有权对于用户行为的规范进行单方认定，并据此处理。<br><br>二、成交后争议仲裁规范<br>1、成交后争议仲裁系指交易完结(系指商城系统显示“已退货”或“已完成”时的状态)前买卖双方提起交易保障要求，商城根据相关要求对交易款项归属作出处理的基本程序与标准。<br>2、本章规定事项为成交后争议仲裁的一般规定，本规范第四章特殊交易争议处理规范有特殊要求的，依照第四章的规定处理。<br>3、买家在商城上的交易过程中，如因商家原因使交易产生纠纷，可提请商城从中予以协调，经商城审核后，有权通过电话或电子邮件等联系方式向纠纷双方了解情况，商家应积极配合商城工作人员调解，商城有权将所了解的情况通过电话或邮件等方式互相通知对方。<br>4、商家交付给买家的商品应当符合法律法规的相关规定，商家发布的商品品类不得超出与商城签订的合同约定范围，且所售商品不得违反商城《商家管理规范总则》和《商城商家违规行为及处理规则》中关于发布违禁信息、滥发信息、滥用关键字，发布违禁商品、广告商品，出售假冒商品、假冒材质成份、出售未经报关进口商品、伪造产地商品等条款的相关规定。<br>5、商家应当对其所售商品进行如实描述，即应当在商品描述页面、店铺页面、商城在线客服系统等所有商城提供的宣传渠道中，对商品的基本属性、成色、瑕疵等必须说明的信息进行真实、完整的描述。如因商家提供的商品信息存在问题而引起的任何纠纷，商家应自行负责解决，商家未能按照商城要求及时解决纠纷的，商城有权视纠纷情况先行处理，商家应当接受商城的一切处理结果；如给商城造成任何损失，全部由商家负责赔偿。商城有权审核商家提供的商品信息，对不符合法律、法规或商城有理由相信如果发布将给商城带来不利影响的商品信息，商城有权要求商家进行修改，也有权拒绝删除该信息。<br>6、商家应当对其所售商品质量承担保证责任，保证有关商品和服务本身的合法性，其交付给买家的商品须已验明产品合格证明和其他标识，并在合理期限内可以正常使用，包括商品不存在危及人身财产安全的不合理危险、具备商品应当具备的使用性能、符合商品或其包装上注明采用的标准等。如因商家非法或违规经营而引起的法律纠纷，由商家自行负责解决，同时，商城有权对涉及的商品做下架处理；如给商城造成损失，商家应负全部责任。<br>7、商品属于“三包”(系指法律法规规定的三包或所在地适用的三包，以下简称“三包规定”)范围内的，买家要求商家履行换货或维修义务的，商家应当按照买家的要求提供相应服务，不可故意拖延或无理拒绝。<br>8、商家所售商品为虚拟物品的，应当确保其交付给买家的虚拟物品符合约定的使用目的和期限，并按照订单约定的数量向买家交付虚拟物品。<br>9、买卖双方应当进行真实交易，不进行以增加信用和销量为目的的虚假交易。<br>10、商家应当在买家付款后的72小时内或与买家约定的时间内发货，如有延迟发货情况出现，按照交易笔数对商家进行处罚。延迟发货是指除特殊商品外，商家在买家付款后实际未在72小时内发货，或定制、预售及其他特殊情形等另行约定发货时间的商品，商家实际未在约定时间内发货，妨害买家购买权益的行为（商家的发货时间，以快递公司系统内记录的时间为准）。商家需向买家支付不超过该商品实际成交金额的30%（金额最高不超过500元）作为违约金。买家申请退款时商家尚未发货的，商家应当征得买家同意后再发货。商家逾期发货，或者未经买家同意在买家申请退款后发货，商家有权追回已经发出的商品，但买家已经签收并确认收货的除外。<br>11、买家应当在订单中向商家提供准确的收货地址和收货人信息。<br>12、买家在提供收货人信息时，可以选择本人或者他人作为收货人。买家选择他人作为收货人，该收货人违反本节约定义务的，由买家承担相应责任。<br>13、因买家填写的收货地址和(或)收货人信息不准确，或者未经商家同意要求变更收货地址或收货人信息，导致商家发货后无法送达的，运费由买家承担。<br>14、买家只填写了收货地址，但没有填写收货人或填写的收货人信息不特定，商品在收货地址被签收的，该签收视为买家本人签收。<br>15、商家按照约定发货后，收货人有收货的义务。<br>16、六、收货人可以本人签收商品或委托他人代为签收商品，被委托人的签收视为收货人本人签收。<br>17、收货人签收商品时，应当对商品进行验收。<br>18、收货人签收商品时发现表面不一致的情形，有权拒绝签收商品。<br>19、对于需要先签收再打开包装查看的商品，收货人应当要求承运人当场监督并打开包装查看，如发现表面不一致，应当在签收单(收货人联和承运人联)上备注详细情况并让承运人签字确认或者直接退回商品。<br>20、收货人签收商品后，商品毁损、灭失及瑕疵的风险由商家转移给买家，但自买家签收起六个月内，因商品瑕疵而发生争议的，由商家承担有关瑕疵的举证责任，举证材料包括但不仅限于买家签收商品单据、产品合格证明、商城质量检验证明等。<br>21、买卖双方达成退货或换货协议，或商城做出退货退款的处理结果后，商家应当在收到商城处理结果后的24小时内或者与买家约定的时间内提供退货地址。商家逾期未提供退货地址的，以其在商城系统内填写的“默认退货地址”作为退货地址。<br>22、商家提供的退货地址错误导致买家操作退回商品后无法送达的，商家承担因此产生的运费。<br>23、买家根据协议约定或商城做出的处理结果操作退货时，应当使用与商家发货时相同的运输方式发货，运费差价由买家承担。除非得到商家的明确同意，买家不得使用到付方式支付运费。退货后，商家有收货的义务。<br>24、买卖双方应当在交易前对商品情况、交易过程及物流费用进行详细、清晰明确的约定。因商家在提供商品或者服务过程中，采取虚假或者其他不正当手段欺骗、误导买家，使买家的合法权益受到损害的，商家需向买家增加赔偿其损失，增加赔偿金额为该商品价款或者服务费用的三倍，增加赔偿的金额不足五百元的，为五百元。法律另有规定的，依照其规定。<br>25、商家应当使用有揽收和签收凭证的运输方式发货。买家要求使用没有揽收和签收凭证的运输方式(以下简称“平信方式”)发货的，商家应当在发货前以商城在线客服系统的方式明确告知买家该方式存在的风险，并截图留证。<br>26、买卖双方指定了特定承运人的，商家应当委托该特定承运人运送商品。商家违反前款约定的，买家有权拒绝签收商品。<br>27、经买家明确同意，商家可以使用到付方式委托承运人发货。未经买家明确同意，商家使用到付方式委托承运人发货的，买家有权拒绝签收商品；买家签收商品的，到付运费超出约定运费的部分由商家承担。本规范所称到付方式系指在委托承运人时不支付运费，而由收货人在收货时向承运人支付运费的运输方式。<br>28、商家应当对运费的承担和组成做出清晰、准确的描述。<br>29、运费由买家承担的，商家应当按照实际发生的金额向买家收取运费，运费水平须与相应物流公司水平保持一致。<br>30、商品在换货或维修过程中需要寄送且未约定运费承担方式的，因此产生的运费由商家承担。<br>31、错发、漏发等需补发商品/配件的流程：商家收到需补发商品/配件的通知后，由商家按照商城发货及配送时限重新直接为客户补发商品/配件，补发产生的运费由商家承担。<br>32、商家交易行为违反法律法规规定，或为依据商城《商家管理规范总则》中的出售假冒商品、出售未经报关进口商品、拖欠贷款、骗取他人财物行为，一经查实，商城将给予相应处罚。<br>33、商品存在质量问题或与网上描述不符的，一经查实，商城将给予相应处罚。<br>34、因商品存在危及人身财产安全的不合理危险，导致买家损失的，由买卖双方另行协商或通过其他途径解决，商城不予处理。<br>35、商家交付给买家的交易凭证虚假，商家不同意重新开具且买家拒绝保留商品的，交易做退货退款处理。<br>36、商家所售商品为虚拟物品的<br>37、就成交后而言，买卖双方采用不正当手段提高商品销量、DSR评分等行为（包括但不限于向商城工作人员及或其关联人士提供财物、消费、款待或商业机会等；通过其他手段谋取不正当利益的，一经查实，商城将给予相应处罚。就售后而言，买卖双方有38、条所述行为的，驳回买家退款要求。<br>38、商家违反发货规范，导致买家未收到货、拒绝签收商品或者签收后退回商品的，交易做退款处理，运费由商家承担。如因延迟发货导致买家投诉的，商家需向买家支付不高于该商品实际成交金额的30%（金额最高不超过500元）作为违约金。<br>39、买家依据签收规范拒绝签收商品或者退回商品的，交易做退款处理，运费由商家承担。涉及表面一致的事项，买家提供有效凭证证明签收时既已存在表面不一致情形的，交易做退款或退货退款处理；买家无法有效举证的，交易做打款处理。<br>40、有关退换货处理措施以买卖双方协商决定为主，若商城介入仲裁，则以相关法律法规、《商家管理规范总则》等平台相关规则规范等为准。此外，买家或商家违反退换货相关规范的，作如下处理：<br>41、买卖双方约定不清，根据本规范无法确定争议的责任归属的，交易作退货退款处理，发货运费由商家承担，退货运费由买家承担。<br>42、交易中的运费争议，根据“谁过错，谁承担”的原则处理，但买卖双方协商一致的除外。本规范已经做出明确规定的，按照相应的规定处理。<br><br>三、售后争议处理规范<br>1、售后争议处理系指交易完结后买卖双方提起交易保障要求，商城对相关要求对交易赔偿作出处理的基本程序与标准。<br>2、符合商城平台规则约定条件的买家在交易成功后提起的未收到货、商品描述不符、商品存在质量问题、商家未履行售后服务或特色服务的保障要求的，参照本规范售中争议处理相应条款进行认定，商城平台规则中有特别规定的除外。<br>3、对于国家规定或者商家与买家约定包修、包换、包退的商品，商家应当负责修理、更换或者退货，在保修期内两次修理仍不能正常使用的，商家应当负责更换或者退货。对包修、包换、包退的大件商品，买家要求商家修理、更换、退货的，商家应当承担运输等合理费用。如商家未按时提供售后服务的，则商城有权视客户投诉情况，直接为客户办理退货退款等事宜，因此产生的全部费用及损失均由商家承担。<br>4、如买家对商家销售的商品真伪、质量、重量（黄金珠宝类）等方面提出质疑的，商家应对疑问作出明确合理的解释，且应提供相应的文件资料予以证明。如商家无法提供文件证明或提供的文件不足以证明客户投诉无依据，则应为客户办理退货，承担退货产生的费用，如因此产生损失的，商家应予以全部赔偿。<br><br>四、特殊交易争议处理规范<br>1、买卖双方不通过本商城或者采用当面交付商品的方式进行交易的，应当自行承担因此产生的风险。<br>2、因买家未收到货产生的争议，交易做退款处理，但商家可以证明买家收到商品的除外。<br>3、因商品表面不一致产生的争议，交易做打款处理，但商家可以证明已自认商品存在表面不一致的除外。<br>4、因商品描述不符、存在质量问题产生的争议，适用本规范第十一条和第十二条的规定进行处理。<br>5、需要买家预先支付部分款项的交易，买卖双方应当具体约定该部分款项的支付和返还条件。仅以“定金”、“订金”、“预付款”等字样进行描述，但未明确约定具体支付和返还条件的，相应争议依据法律规定参照第二章和第三章的处理。<br>6、买卖双方进行定制商品交易的，应当对商品的交付时间、交付标准作明确的约定。未约定具体交付时间的，商家应当在买家首次要求交付后的三天内发货。未约定交付标准的，适用本规范第三十二条的规定进行处理。<br>7、买卖双方约定的商品交付时间届满前，买家不得要求退款，但商家明确表明不履行定制合同的除外。<br>8、买家无正当理由拒绝签收定制商品的，应当承担商家因此产生的损失，具体标准由商城根据实际情况判断。<br><br>五、举证责任<br>1、争议处理过程中，商城有权要求买家或商家提供证明证据，且有权单方判断证据的效力。<br>2、买家主张未收到货的，商家对买家已按照本规范规定签收商品承担举证责任。<br>3、买家签收商品后，因表面不一致产生争议的，买家对签收商品时即已存在表面不一致的情形承担举证责任。但对于商家提供的冰箱洗衣机、厨房卫浴电器、电脑、家用视听设备、空调、整车等耐用商品或者装修设计/施工/监理等服务，自买家签收商品（以物流签收时间为准）或接受服务之日起六个月内，因商品瑕疵而发生争议的，由商家承担有关瑕疵的举证责任，举证材料包括但不仅限于买家签收商品单据、产品合格证明、商城质量检验证明等。<br>4、买家主张收到的商品存在质量问题或系假冒商品且通过肉眼无法做出判断的，商家应当按照商城的要求提供厂家的经销凭证、产品合格证、商业发票等证明文件。买家主张商品存在质量问题或与网上描述不符，且可通过肉眼做出判断的，商城有权根据商品图片直接认定。<br>5、商家提供符合本规范第五十条规定的证明文件后，买家应当根据商城的要求提供相应的检测凭证。<br>6、如果商家没有声明发货，但在买家申请退款前已经实际发货的，应当提供相应的发货凭证。<br>7、因虚拟物品产生的争议，买卖双方应当按照商城的要求提供相关官方网站的查询记录或者相关单位的书面证明进行举证。<br>8、针对商城受理的各类型争议所需提供的全部证明文件，以商城要求的内容为准。<br>9、商城作为独立第三方，仅对双方提交的证据进行形式审查，并作出独立判断，双方自行对证据的真实性、完整性、准确性和及时性负责，并承担举证不能的后果。<br><br>六、争议仲裁程序<br>1、买申请退款后，买卖双方可以选择自行协商、要求商城介入或通过司法途径等方式解决存在的争议。任一方要求商城介入的，商城即有权根据本规范对争议进行仲裁。<br>2、买卖双方向商城申请争议仲裁，必须符合以下条件：<br>3、商城对符合第五十九条的争议处理申请，予以受理；对下列申请，分别情形，予以处理。<br>4、商城处理争议期间，买卖双方应当按照商城系统的提示和（或）商城规定的时间内提供凭证。<br>5、商城收集到双方提供的凭证后，将在商城系统提示的时间内，按照本规范对相应争议仲裁；本规范没有明确规定的，由商城依其独立判断仲裁。<br>6、商城按照其独立判断，根据不同情况，将对买卖双方的争议做类型的处理。<br>7、商城处理争议期间，有下列情形之一的，商城中止处理相应争议。<br>8、买卖双方一致要求自行协商处理争议的，应当在提出协商要求后的30天内自行操作交易款项，或向商城提供协商结果，由商城代为操作。逾期未操作交易款项也未告知协商结果的，商城有权根据本规范处理争议。<br>9、商城处理争议期间，买卖双方达成退款协议，但无法自行操作的，商城将根据双方达成的退款协议，通知本商城操作相应的交易款项和（或）保证金。<br>10、商城对争议做出处理后，有权通知本商城按照处理结果将交易款项和（或）保证金的全部或部分支付给买家和（或）商家，或由商家（或买家）按照处理结果将相关款项支付给买家（或商家）。<br>11、在将交易款项全部支付给买家后，根据争议处理结果仍需商家承担责任的，商城有权通知本商城，自商家根据《商家管理规范总则》缴纳的保证金或其他款项中划拨相应的钱款补偿支付给买家。<br>12、处理争议期间，商城使用消费者保障资金代替商家先行退款给买家（亦称“先行垫付”）的，交易做出处理后，商城有权通知本商城，将交易款项、保证金或买家易付宝账户中与先行垫付金额相当的部分划扣至消费者保证基金账户。<br>13、商城对争议做出处理并通知本商城支付争议款项后，买家或(和)商家对商城的处理有异议的，可向人民法院起诉。<br>14、争议通过司法途径解决的，商城将根据司法机关的生效法律文书，通知本商城操作相应的交易款项和相关保证金。<br><br>七、附则<br>1、商城对争议做出处理后，不免除买卖双方基于与商城签署的其他协议、规则应当承担的责任。<br>2、商城定期或不定期的官方活动规则，对买卖双方争议处理有特殊要求的，按照活动规则的特殊要求进行处理。<br>3、本规范生效或变更前商城已介入处理的争议，适用当时的规范进行处理；本规范生效或变更后商城介入处理的争议，适用本规范或变更后的规范进行处理。</p>', '0', '', '', null, null, null, '规则中心', '8');
INSERT INTO `article` VALUES ('1306078813536509953', '2020-09-16 03:53:50', null, '0', '小象电商网乐购', '<p>隐私政策</p><p>About</p><p><br></p><p>本软件尊重并保护所有使用服务用户的个人隐私权。为了给您提供更准确、更有个性化的服务，本软件会按照本隐私权政策的规定使用和披露您的个人信息。但本软件将以高度的勤勉、审慎义务对待这些信息。除本隐私权政策另有规定外，在未征得您事先许可的情况下，本软件不会将这些信息对外披露或向第三方提供。本软件会不时更新本隐私权政策。您在同意本软件服务使用协议之时，即视为您已经同意本隐私权政策全部内容。本隐私权政策属于本软件服务使用协议不可分割的一部分。</p><p>&nbsp;</p><p>1.适用范围</p><p>a)在您使用本软件网络服务，本软件自动接收并记录的您的手机上的信息，包括但不限于您的健康数据、使用的语言、访问日期和时间、软硬件特征信息及您需求的网页记录等数据；</p><p>&nbsp;</p><p>2.信息的使用</p><p>a)在获得您的数据之后，本软件会将其上传至服务器，以生成您的排行榜数据，以便您能够更好地使用服务。&nbsp;</p><p>&nbsp;</p><p>3.信息披露&nbsp;</p><p>a)本软件不会将您的信息披露给不受信任的第三方。&nbsp;</p><p>b)根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；&nbsp;</p><p>c)如您出现违反中国有关法律、法规或者相关规则的情况，需要向第三方披露；&nbsp;</p><p>&nbsp;</p><p>4.信息存储和交换 本软件收集的有关您的信息和资料将保存在本软件及（或）其关联公司的服务器上，这些信息和资料可能传送至您所在国家、地区或本软件收集信息和资料所在地的境外并在境外被访问、存储和展示。</p><p>&nbsp;</p><p>5.信息安全&nbsp;</p><p>a)在使用本软件网络服务进行网上交易时，您不可避免的要向交易对方或潜在的交易对方披露自己的个人信息，如联络方式或者邮政地址。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。如您发现自己的个人信息泄密，请您立即联络本软件客服，以便本软件采取相应措施。&nbsp;</p><p><br></p><p>©2018 -GUANGZHOU FRIENDSHIP GROUP CO.,LTD.,</p>', '0', '', '', null, null, null, '隐私政策', '1255471441764257794');
INSERT INTO `article` VALUES ('1306175663576821761', '2020-09-16 10:18:40', '2020-09-23 03:47:55', '2', '小象电商网乐购', '<table width=\"1001\" border=\"0\" align=\"center\" cellpadding=\"0\" cellspacing=\"0\" style=\"color: rgb(51, 51, 51); font-family: Arial, Helvetica, sans-serif; text-align: center;\"><tbody><tr><td width=\"1001\" align=\"left\" valign=\"top\"><table width=\"1002px\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin: 3px 0px;\"><tbody><tr><td width=\"24%\" height=\"3\" bgcolor=\"#b30b71\"></td><td width=\"76%\" bgcolor=\"#d8d8d8\"></td></tr></tbody></table><table width=\"100%\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\"><tbody><tr><td><div id=\"Article_Content\" style=\"padding: 5px; text-indent: 10px; line-height: 22px; font-family: 宋体; color: rgb(94, 86, 86); width: 1002px;\"><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">一、 知识产权&nbsp;</span><span style=\"font-size: 9pt; text-indent: 2em; background-color: transparent; text-align: center;\">本站所有内容，包括但不限于文字、图形、影音、程序、电子邮件的全部内容、网站布局、网页设计、网站架构及资料编辑、使用之软件或程序，其著作 权均属于本公司或授权本公司使用之正当权利人。在未经本公司或正当权利人合法授权前，任何人不得以任何形式复制、编辑、散布、公开发表、进行还原工程、解 编或反向组译。尊重知识产权是您应尽的义务，否则本公司将依法追诉并请求赔偿。</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">二&nbsp;、个人信息使用&nbsp;</span><span style=\"font-size: 9pt; text-indent: 2em; background-color: transparent; text-align: center;\">小象电商网上商城将为以下目的使用您的个人信息：</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（一）&nbsp;就各项促销活动或商品销售之预订相关服务向您提供小象电商网上商城顾客支持；</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（二）向您提供</span><span style=\"font-size: 9pt;\">小象电商的产品、服务、礼品以及促销活动的最新信息；&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（三）随时征询您的意见；&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（四）编制小象电商网上商城的统计资料。&nbsp;为确保上述目的，您的个人信息可能在小象电商及其关联企业之间共享。如果使用目的发生任何改变，小象电商网上商城将通知您，并再次征求您的同意。请注意如果您不提供个人信息，某些服务可能无法实现。</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">三、个人信息保存&nbsp;小象电商网上商城保证采取一切适当的技术上的和组织上的措施防止您的个人信息为任何未经授权的第三方获取或使用。小象电商网上商城将在为达到上述目的而视为合理必要的期间内保存个人信息。&nbsp;</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">四、个人信息保护&nbsp;本站遵守刊登在本站的隐私权政策，处理会员所传输的资料或通讯，除以下情况外，未获得会员同意以前，本站不对外揭露会员之姓名、地址、电子邮件地址及其他依法受保护之个人资料：&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（一）基于法律规定。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（二）受司法机关或其他有权机关基于法定程序之要求。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（三）为保障本公司财产及权益。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（四）在紧急情况下为维护其他会员或第三人之人身安全。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（五）本站将不销售或任意提供给第三者（个人或公司团体）会员之登记资料，但是若为本站主办或协办之活动，因寄发赠品或联络需要，本站有权使用会员部分资料。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（六）对于会员所登录或留存之个人资料，会员同意本公司及本公司之关系企业或合作伙伴，有权在法律许可之范围内搜集、处理、保存、传递及使用该等资料，以提供会员其他资讯或服务、作成会员统计资料或进行关于网路行为之调查或研究。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（七）会员要求本公司或授权某人通过电子邮件服务透露这些信息。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（八）为本公司向会员提供服务的目的。</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">五、会员注册义务&nbsp;会员同意遵守所有与本站服务相关之国内、国际法律及以下规定，并同意不干扰他人使用此项服务：&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（一）自行提供上网设备，包括电脑及上网装置；&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（二）自行支付上网所需的电话费用以及与使用本站服务所需会员自行承担的费用；&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（三）依本站会员注册表之提示提供本人正确、最新及完整的资料（以下简称“注册资料”）。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（四）&nbsp;若您提供任何错误、不实、过时或不完整的资料，或本站合理怀疑资料错误、不实、过时或不完整，本站有权暂停或终止您的帐号，并拒绝向您提供部分或全部服务。&nbsp;</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">六、会员帐号、密码及安全&nbsp;会员应确保密码及帐号的机密安全，本站不负保管责任，会员同意以下事项：&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（一）会员密码或帐号遭到未获授权的使用，或其他任何安全问题发生时，会员应立即通知本站。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（二）每次连线完毕，请确实结束帐号使用，如您未能遵守本项规定而发生任何损失，本站概不负责。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（三）如果会员未保管好自己的帐号和密码而对会员、本公司或第三方造成的损害，会员将承担责任。</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">七、会员行为&nbsp;本站保留删除任何危害他人著作权或专利内容的权利，会员同意遵守并配合以下条款：&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（一）严禁使用本站所有相关服务从事非法行为。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（二）严禁从事干扰或中断相关服务器或网路的行为。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（三）遵守所有连接至此网路的要求、规则、程序及政策。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（四）不得转售此项免费服务或连接至此的各项免费服务而居中牟利。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（五）不得张贴或传播任何不实广告、宣传资料或其他形式的诱骗性广告。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（六）不得传输任何有侵犯他人权利的资料。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（七）不得传输违反现行法律、国际相关法律的资料。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（八）不得利用本站传输任何非法、有害、威胁、辱骂、干扰性、诽谤、粗俗、淫秽、憎恨或其他任何有违良好道德风尚的资料、文字、图片、档案、连结、软件或其他资料。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（九）不得进入本站计算机信息网络或者使用计算机信息网络资源。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（十）不得对本站计算机信息网络功能进行删除、修改或者增加。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（十一）不得进入本站计算机信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（十二）不得制作、传播计算机病毒以及通过其他方式破坏程序。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（十三）不得进行其他危害计算机信息网络安全的行为。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（十四）不得以任何方式干扰本公司的服务。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（十五）遵守本站规定的所有程序。</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">八、 相关法律法规&nbsp;本站所有画面、资料非经本站同意不得进行复制、移转、租用、出售；会员必须遵守包括电信法在内的相关法律法规，若违反相关法律法规致本公司 损失，本公司将依法请求赔偿。&nbsp;本站会员必须遵守本同意书之各项约定及本站所列之各项规定，若会员违反规定，本站有权暂停或终止会员的帐号和资格，并拒绝 向会员提供部分或全部服务。本站有权变更条款所载事项，会员同意如有违反有关事项时，本站有权随时终止所提供的服务并保留法律追诉权。</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">九、 会员通知&nbsp;会员通知将经由电子邮件或一般邮件发送，本公司可选择通过会员通知的方式或在本站上明示的方式告知会员有关服务内容、更新或修改的服务条件。如 会员发现任何违反本同意书条款之情形，请通知小象电商网上商城客户服务中心。&nbsp;会员在此授权本公司可以向其电子邮箱发送商业及服务信息。&nbsp;</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">十、&nbsp;广告&nbsp;您在本站上浏览到的所有广告内容、文字与图片之说明、展示样品或其他销售资讯，均以本公司或其门店实际发布的广告内容为准。</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">十一、&nbsp;免责声明&nbsp;您明确了解并同意：&nbsp;小象电商网上商城对本站服务不提供任何明示或默示的担保，包含但不限于商业适售性、特定目的之适用性及未侵害他人权利。&nbsp;小象电商网上商城不保证以下事项：&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（一）本站将符合您的需求。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（二）本站不受干扰、及时提供、安全可靠或免于出错。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（三）由本站提供的信息为正确、及时、真实、可靠。&nbsp;</span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">&nbsp;&nbsp;（四）您经由本站取得的任何服务、资讯或其他资料将符合您的期望。&nbsp;是否经由本服务之使用下载或取得任何资料应由您自行考量且自负风险，因任何资料之下载而导致您电脑系统之任何损坏或资料流失，本公司不承担任何责任。</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">十 二、会员声明&nbsp;会员声明其为具备中华人民共和国法律规定的完全民事行为能力的自然人，或者是具有相应合法证照的实体组织，能够独立并完全地享受民事权利和 承担民事责任。无民事行为能力人、限制民事行为能力人以及无合法证照的组织注册为本站会员的，一经发现，本公司有权注销会员资格。会员进一步声明，会员系 经仔细阅读并审慎考虑上述内容后接受本同意书及其条款和条件的，其将遵守本同意书之各项约定及本站所列之各项规定。</span><span style=\"font-size: 9pt;\"></span></p><p class=\"p16\" style=\"margin-top: 0pt; margin-bottom: 0pt; text-indent: 2em;\"><span style=\"font-size: 9pt;\">十三、适用法律&nbsp;本同意书之解释与适用，以及与本同意书有关的争议，均应依照中华人民共和国（为本同意书之目的，不包括香港、台湾、澳门地区）法律予以处理。</span></p></div></td></tr></tbody></table></td></tr></tbody></table>', '0', '', '', null, null, null, '用户服务协议', '1255471441764257794');
INSERT INTO `article` VALUES ('1312274983929634818', '2020-10-03 06:15:12', '2020-10-04 01:37:43', '2', null, '<p><h3>网上账户充值（只适用于背面有可刮开涂层的积分卡）</h3><br>\r\n<br></p><p>点击“登录”，进入登陆界面。</p><p></p><p><img style=\"width: 846px;\" src=\"/upload/image/202010/22553b1b-55c3-45d9-9b19-719bf9b48a9f.jpg\"><br>\r\n<br>点击“会员中心”，进入“我的商城帐户”。</p><p><img style=\"width: 846px;\" src=\"/upload/image/202010/e808d1f6-f5c5-4b6d-8377-34665a269e39.jpg\"><br>\r\n<br>【会员中心】界面-【预存款】-积分卡充值</p><p><img style=\"width: 846px;\" src=\"/upload/image/202010/0ee23491-6940-4084-9591-4a278fa77ecb.jpg\"><br>\r\n<br></p><p><img style=\"width: 774px;\" src=\"/upload/image/202010/0802b40e-e03a-4cb8-815d-76ad97ad3f83.jpg\"><br>输入积分卡正面的前13位卡号到“充值卡卡号”（后5位卡号不用输入）；刮开积分卡背面的涂层，获取积分卡密码并输入到“充值卡密码”中，点击“提交”，余额将会一次性充值到网上帐户中。<br>\r\n<br>充值成功后，积分卡余额转入商城帐户（该积分卡不再使用）。<br>\r\n<br>此操作不可逆转<br></p>', '0', '', '', null, null, null, '积分卡线上充值教程', '4');
INSERT INTO `article` VALUES ('1312279160680472578', '2020-10-03 06:31:48', '2020-10-04 02:02:19', '1', null, '<p>商城会员通过绑定实体店VIP卡，可享受与实体店相同的折扣优惠与积分。<br>&nbsp;&nbsp;&nbsp; 激活小象电商VIP卡详细步骤：<br><br>进入小象电商网乐购首页，登录 会员中心，如果非会员，请 注册 后再登录；<br><img style=\"width: 846px;\" src=\"/upload/image/202010/3ff9b501-3cef-4e69-937c-531cf281f101.jpg\"><br><br>进入【会员中心】后，点击【个人资料】的“会员卡号”中填写VIP卡号（输入小象电商VIP卡的后9位数字）；，<br>例如：下图为VIP贵宾卡，只需输入卡号后9位数字，红色下划线内容，<br><img style=\"width: 322px;\" src=\"https://mall.cgzfs.com/userfiles/image/%E5%B8%AE%E5%8A%A9%E4%B8%AD%E5%BF%83/image008(1).jpg\"><br><br><br><br></p>', '0', '', '', null, null, null, '使用VIP卡的方法', '1');
INSERT INTO `article` VALUES ('1312281091347963905', '2020-10-03 06:39:28', null, '0', null, '<p><img style=\"width: 846px;\" src=\"/upload/image/202010/b767e829-8a01-4d2a-8621-8a07a8593875.png\"><br></p>', '0', '', '', null, null, null, '证件公示', '1');
INSERT INTO `article` VALUES ('1312281802911637505', '2020-10-03 06:42:17', null, '0', null, '<p><br></p><div style=\"margin: 0px; padding: 0px; color: rgb(94, 86, 86); font-family: 宋体; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-indent: 10px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial; line-height: 22px;\"><p style=\"margin: 0px; padding: 0px; text-indent: 2em;\">一、大家电品</p><p style=\"margin: 0px; padding: 0px; text-indent: 2em;\">（1）大家电品类说明</p><ul style=\"margin: 0px; padding: 0px; list-style: none;\"><li style=\"margin: 0px; padding: 0px; list-style: none;\">小象电商网上商城大家电品类包括：空调、平板电视、冷柜、洗衣机、电热水器、燃气热水器、吸油烟机、燃气灶、燃气炉、消毒柜、洗碗机、家庭音响等。</li></ul><p style=\"margin: 0px; padding: 0px; text-indent: 2em;\">（2）大家电品类服务</p><p style=\"margin: 0px; padding: 0px; text-indent: 2em;\">&nbsp;&nbsp;&nbsp;送货商品类别：家电、家居用品、办公设备、大型组件工艺品、大型玩具等重量超过25公斤或总体积超过0.06立方米的单件商品，以及其他大批量商品。</p><ol style=\"margin: 0px; padding: 0px;\"><li style=\"margin: 0px; padding: 0px; list-style: none;\">购买大件家电商品，市区范围内，提供免费、免带车预约送货上门；</li><li style=\"margin: 0px; padding: 0px; list-style: none;\">免费代客安装空调机（不包括安装材料）；</li><li style=\"margin: 0px; padding: 0px; list-style: none;\">免费代客安装热水器、抽油烟机、滚筒洗衣机（不包括安装材料及部分安装工序）；</li><li style=\"margin: 0px; padding: 0px; list-style: none;\">购买套装音响、电视机市区范围内可免费预约上门调试；</li><li style=\"margin: 0px; padding: 0px; list-style: none;\">购买按摩椅，提供市区范围内免费预约上门安装服务；</li></ol></div><p><br></p><p style=\"margin: 0px; padding: 0px; text-indent: 2em; color: rgb(94, 86, 86); font-family: 宋体; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">二、免费送货范围及免费送货标准<br>1、东面：东二环环城高速公路以西方向（萝岗~番禺东涌之间的东二环），并沿广源快速公路至凤凰城止。<br>2、南面：以沙湾河道~顺德河道为界以北方向。顺德区：北江大桥、龙江大桥、龙江二桥、三洪奇大桥、西海大桥；番禺区：三善大桥、北斗大桥、观音沙大桥以北方向。<br>3、西面：佛山一环（南庄~乐平）以东方向。<br>4、北面：西二环乐平段~北二环（佛山乐平~萝岗）以南方向，并沿广清高速、京珠高速延伸至花都新华、竹料、钟落潭以南区域。<br>5、一次性购物满10万元以上，免收100公里超程费；10万元~20万元购物额，每超过1万再减免10公里；超20万元省内免费送货。</p><p><br></p><p style=\"margin: 0px; padding: 0px; text-indent: 2em; color: rgb(94, 86, 86); font-family: 宋体; font-size: 12px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); text-decoration-style: initial; text-decoration-color: initial;\">三、超出上述免费送货范围或未达到购物优惠免费送货服务条款规定的，顾客需支付超程送货运送费用，该费用含：过桥费、渡轮费、隧道费、临时停车费及车辆运输成本等。（详情可以咨询020-0000000）</p><p><br></p>', '0', '', '', null, null, null, '大家电配送服务', '1');
INSERT INTO `article` VALUES ('1312282953459556354', '2020-10-03 06:46:52', '2020-10-04 06:05:01', '3', null, '<h3>选择微信支付、支付宝、在线银联等支付方式时，如需报销发票，下单时勾选【发票】栏目，并填写相关信息<br>使用网乐购余额支付不再开具报销发票，若购买电器类商品，我们将统一开具保修发票，发票将随货物一起寄到。</h3><br><p><img style=\"width: 846px;\" src=\"/upload/image/202010/fcc6abec-a6f6-4476-8d66-a4df44906c0e.jpg\"><br></p>', '0', '', '', null, null, null, '如何获得发票', '1');
INSERT INTO `article` VALUES ('1312636793887158273', '2020-10-04 06:12:54', null, '0', null, '<p>一、网乐购支持积分卡余额支付、微信支付、支付宝支付、在线银联等方式。<br><br>二、组合支付：可使用两种不同支付方式一起付款的功能。<br>当您的资产积分卡余额不足以支付订单金额时，可使用组合支付功能。<br></p>', '0', '', '', null, null, null, '支付方式', '1');
INSERT INTO `article` VALUES ('1312637465302953985', '2020-10-04 06:15:34', null, '0', null, '<p>一、 知识产权 本站所有内容，包括但不限于文字、图形、影音、程序、电子邮件的全部内容、网站布局、网页设计、网站架构及资料编辑、使用之软件或程序，其著作 权均属于本公司或授权本公司使用之正当权利人。在未经本公司或正当权利人合法授权前，任何人不得以任何形式复制、编辑、散布、公开发表、进行还原工程、解 编或反向组译。尊重知识产权是您应尽的义务，否则本公司将依法追诉并请求赔偿。<br><br>二 、个人信息使用 小象电商网上商城将为以下目的使用您的个人信息：<br><br>&nbsp; （一） 就各项促销活动或商品销售之预订相关服务向您提供小象电商网上商城顾客支持；<br><br>&nbsp; （二）向您提供小象电商的产品、服务、礼品以及促销活动的最新信息； <br><br>&nbsp; （三）随时征询您的意见； <br><br>&nbsp; （四）编制小象电商网上商城的统计资料。 为确保上述目的，您的个人信息可能在小象电商及其关联企业之间共享。如果使用目的发生任何改变，小象电商网上商城将通知您，并再次征求您的同意。请注意如果您不提供个人信息，某些服务可能无法实现。<br><br>三、个人信息保存 小象电商网上商城保证采取一切适当的技术上的和组织上的措施防止您的个人信息为任何未经授权的第三方获取或使用。小象电商网上商城将在为达到上述目的而视为合理必要的期间内保存个人信息。 <br><br>四、个人信息保护 本站遵守刊登在本站的隐私权政策，处理会员所传输的资料或通讯，除以下情况外，未获得会员同意以前，本站不对外揭露会员之姓名、地址、电子邮件地址及其他依法受保护之个人资料： <br><br>&nbsp; （一）基于法律规定。 <br><br>&nbsp; （二）受司法机关或其他有权机关基于法定程序之要求。 <br><br>&nbsp; （三）为保障本公司财产及权益。 <br><br>&nbsp; （四）在紧急情况下为维护其他会员或第三人之人身安全。 <br><br>&nbsp; （五）本站将不销售或任意提供给第三者（个人或公司团体）会员之登记资料，但是若为本站主办或协办之活动，因寄发赠品或联络需要，本站有权使用会员部分资料。 <br><br>&nbsp; （六）对于会员所登录或留存之个人资料，会员同意本公司及本公司之关系企业或合作伙伴，有权在法律许可之范围内搜集、处理、保存、传递及使用该等资料，以提供会员其他资讯或服务、作成会员统计资料或进行关于网路行为之调查或研究。 <br><br>&nbsp; （七）会员要求本公司或授权某人通过电子邮件服务透露这些信息。 <br><br>&nbsp; （八）为本公司向会员提供服务的目的。<br><br>五、会员注册义务 会员同意遵守所有与本站服务相关之国内、国际法律及以下规定，并同意不干扰他人使用此项服务： <br><br>&nbsp; （一）自行提供上网设备，包括电脑及上网装置； <br><br>&nbsp; （二）自行支付上网所需的电话费用以及与使用本站服务所需会员自行承担的费用； <br><br>&nbsp; （三）依本站会员注册表之提示提供本人正确、最新及完整的资料（以下简称“注册资料”）。 <br><br>&nbsp; （四） 若您提供任何错误、不实、过时或不完整的资料，或本站合理怀疑资料错误、不实、过时或不完整，本站有权暂停或终止您的帐号，并拒绝向您提供部分或全部服务。 <br><br>六、会员帐号、密码及安全 会员应确保密码及帐号的机密安全，本站不负保管责任，会员同意以下事项： <br><br>&nbsp; （一）会员密码或帐号遭到未获授权的使用，或其他任何安全问题发生时，会员应立即通知本站。 <br><br>&nbsp; （二）每次连线完毕，请确实结束帐号使用，如您未能遵守本项规定而发生任何损失，本站概不负责。 <br><br>&nbsp; （三）如果会员未保管好自己的帐号和密码而对会员、本公司或第三方造成的损害，会员将承担责任。<br><br>七、会员行为 本站保留删除任何危害他人著作权或专利内容的权利，会员同意遵守并配合以下条款： <br><br>&nbsp; （一）严禁使用本站所有相关服务从事非法行为。 <br><br>&nbsp; （二）严禁从事干扰或中断相关服务器或网路的行为。 <br><br>&nbsp; （三）遵守所有连接至此网路的要求、规则、程序及政策。 <br><br>&nbsp; （四）不得转售此项免费服务或连接至此的各项免费服务而居中牟利。 <br><br>&nbsp; （五）不得张贴或传播任何不实广告、宣传资料或其他形式的诱骗性广告。 <br><br>&nbsp; （六）不得传输任何有侵犯他人权利的资料。 <br><br>&nbsp; （七）不得传输违反现行法律、国际相关法律的资料。 <br><br>&nbsp; （八）不得利用本站传输任何非法、有害、威胁、辱骂、干扰性、诽谤、粗俗、淫秽、憎恨或其他任何有违良好道德风尚的资料、文字、图片、档案、连结、软件或其他资料。 <br><br>&nbsp; （九）不得进入本站计算机信息网络或者使用计算机信息网络资源。 <br><br>&nbsp; （十）不得对本站计算机信息网络功能进行删除、修改或者增加。 <br><br>&nbsp; （十一）不得进入本站计算机信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加。 <br><br>&nbsp; （十二）不得制作、传播计算机病毒以及通过其他方式破坏程序。 <br><br>&nbsp; （十三）不得进行其他危害计算机信息网络安全的行为。 <br><br>&nbsp; （十四）不得以任何方式干扰本公司的服务。 <br><br>&nbsp; （十五）遵守本站规定的所有程序。<br><br>八、 相关法律法规 本站所有画面、资料非经本站同意不得进行复制、移转、租用、出售；会员必须遵守包括电信法在内的相关法律法规，若违反相关法律法规致本公司 损失，本公司将依法请求赔偿。 本站会员必须遵守本同意书之各项约定及本站所列之各项规定，若会员违反规定，本站有权暂停或终止会员的帐号和资格，并拒绝 向会员提供部分或全部服务。本站有权变更条款所载事项，会员同意如有违反有关事项时，本站有权随时终止所提供的服务并保留法律追诉权。<br><br>九、 会员通知 会员通知将经由电子邮件或一般邮件发送，本公司可选择通过会员通知的方式或在本站上明示的方式告知会员有关服务内容、更新或修改的服务条件。如 会员发现任何违反本同意书条款之情形，请通知小象电商网上商城客户服务中心。 会员在此授权本公司可以向其电子邮箱发送商业及服务信息。 <br><br>十、 广告 您在本站上浏览到的所有广告内容、文字与图片之说明、展示样品或其他销售资讯，均以本公司或其门店实际发布的广告内容为准。<br><br>十一、 免责声明 您明确了解并同意： 小象电商网上商城对本站服务不提供任何明示或默示的担保，包含但不限于商业适售性、特定目的之适用性及未侵害他人权利。 小象电商网上商城不保证以下事项： <br><br>&nbsp; （一）本站将符合您的需求。 <br><br>&nbsp; （二）本站不受干扰、及时提供、安全可靠或免于出错。 <br><br>&nbsp; （三）由本站提供的信息为正确、及时、真实、可靠。 <br><br>&nbsp; （四）您经由本站取得的任何服务、资讯或其他资料将符合您的期望。 是否经由本服务之使用下载或取得任何资料应由您自行考量且自负风险，因任何资料之下载而导致您电脑系统之任何损坏或资料流失，本公司不承担任何责任。<br><br>十 二、会员声明 会员声明其为具备中华人民共和国法律规定的完全民事行为能力的自然人，或者是具有相应合法证照的实体组织，能够独立并完全地享受民事权利和 承担民事责任。无民事行为能力人、限制民事行为能力人以及无合法证照的组织注册为本站会员的，一经发现，本公司有权注销会员资格。会员进一步声明，会员系 经仔细阅读并审慎考虑上述内容后接受本同意书及其条款和条件的，其将遵守本同意书之各项约定及本站所列之各项规定。<br><br>十三、适用法律 本同意书之解释与适用，以及与本同意书有关的争议，均应依照中华人民共和国（为本同意书之目的，不包括香港、台湾、澳门地区）法律予以处理。<br></p>', '0', '', '', null, null, null, '交易条款及服务协议', '1');
INSERT INTO `article` VALUES ('1312637672237330433', '2020-10-04 06:16:23', null, '0', null, '<p><br>1.服务承诺<br>&nbsp;&nbsp;&nbsp; 为强化网上商城商品质量管理，维护销费者的合法权益，提高企业的信誉，为此，我们向社会承诺。<br>（1）坚持守法经营、自觉履行各项法定义务。<br>（2）严格按照国家和公司的商品准入制度进货，确保上场商品符合相关的法规要求。<br>（3）不销售假冒伪劣和不合格商品。<br>（4）不销售国家明令禁止销售的物品。<br>（5）不销售不符合食品安全标准的食品。<br>（6）严格执行不合格商品退市制度。<br>（7）国家颁布《部分商品修理更换退货责任规定》目录内的商品，严格按《规定》中的修理、更换、退货办法负责执行“三包”。<br>（8）上述国家颁布《规定》目录以外的商品，严格按本店出售时约定的“三包”条件负责执行“三包”。<br>（9）诚信经营，不作虚假的和误导消费者的宣传。<br>（10）接受社会各界及消费者的监督，抵制违法商品。<br>（11）加强商品质量管理，销售优质合格商品。<br><br>2.售后服务流程<br>&nbsp;&nbsp;&nbsp; 网购商品所享受的售后服务，与实体店购物的售后服务一致。客人可持商品及购物凭证到我司环东店的对应专柜处理，以便享受到更专业的售后服务及购物建议。<br>&nbsp;&nbsp;&nbsp; 若客人不便亲临商店处理售后事宜，可致电小象电商网上商城客服热线020-0000000，反映您的售后服务要求。收到您的申请后，我们的售后服务人员将为您提供个性化贴身的售后服务。<br><br>3.《小象电商网上商城退换货政策》<br>&nbsp;&nbsp; （1）商品退换货政策<br>&nbsp;&nbsp;&nbsp; 本公司严格执行国家“三包”（包修、包换、包退）的规定，开展商品质量跟踪反馈活动。<br>&nbsp;&nbsp;&nbsp; a.发货错误或货物被损：当您收到订购的商品时,请立即当着送货人员的面打开检查。如果发现发货错误或商品破损，请您将该货物退还给我们的送货人员。我们将为您更换, 或全额退款。<br>&nbsp;&nbsp;&nbsp; b.家电类以外的其它商品的退换办法<br>&nbsp;&nbsp;&nbsp; (a)国家规定属于\"三包\"（包修、包换、包退）的商品，本公司严格执行\"三包\"的规定。<br>&nbsp;&nbsp;&nbsp; (b)明确规定属于本公司保修的商品，出售后在保修期内如出现质量问题，其检修和更换零件的费用由本公司负责。<br>&nbsp;&nbsp;&nbsp; (c)零售商品出售后无污无损无残缺，不影响按原价再次出售且不属于售前已明确规定为不宜退换的商品（详见“特殊商品退换货说明”），凭购买该商品的发票、小票等有效凭证1个月内可进行退换。<br>&nbsp;&nbsp;&nbsp; (d)本公司决不经营假冒伪劣商品，如发现涉嫌假冒伪劣商品可向本公司质量跟踪站举报。一经核实对该商品按《消费者权益保护法》处理。<br>&nbsp;&nbsp;&nbsp; (e)消费者按规定退换商品时，无论商品价格是否已经产生变化，均按消费者的购货原价计算，给予更换或退款。<br>&nbsp;&nbsp;&nbsp; (f)如果对本网站的零售商品维修、退换处理结果有疑义或不满之处，可到网上客服中心投诉。<br><br>&nbsp;&nbsp;&nbsp; c.家用电器类商品的退换办法<br>&nbsp;&nbsp;&nbsp; (a)本章适用于小象电商网上商城出售的家用电器（不含已开箱、安装的电脑、空调、电视机、热水器、抽油烟机等商品）。<br>&nbsp;&nbsp;&nbsp; (b)消费者购买的家用电器商品，自售出之日起7日内，若发生性能故障而不能正常使用时，只要不残、不损、不污、附件齐全、内外包装完整，消费者持购物凭证和保修证书可选择换货或退货。退货时，将按购物凭证载明的销售价格和付款方式一次退清货款。<br>&nbsp;&nbsp;&nbsp; (c) 自售出之日起15日内，若发生性能故障而不能正常使用时，只要不残、不损、不污、附件齐全、内外包装完整，消费者持购物凭证和保修证书可免费更换同品牌、 同型号的商品，若无同品牌、同型号的商品时，小象电商网上商城可根据顾客的意愿更换其它品种，或按购物凭证载明的销售价格一次退清货款。<br>&nbsp;&nbsp;&nbsp; (d)换货后的商品，其三包有效期自换货之日起重新计算。换货时，小象电商网上商城将在原发票背面加盖印章、写明换货日期，并给消费者开具新的三包凭证，或者在原三包凭证背面加盖更换章。<br>&nbsp;&nbsp;&nbsp; (e)凡在三包有效期内，由于商品的性能故障而影响正常使用时，小象电商网上商城将按以下规定办理：<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ①自送修之日起30日内未修好的，根据维修的证明并根据消费者意愿予以更换同等价值的同类商品；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ②同一故障在保修期内连续修理两次仍未修好的，由小象电商网上商城为消费者更换同品牌、同型号的商品，如无同型号商品更换的，由顾客选择异型号换货或作退货处理；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ③在更换品种或退货时应收取折旧费：折旧费=使用天数（自购买之日起计算）×商品售价×折旧率；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ④凡属下列情况之一者，不实行三包，但可以实行收费修理：<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 1)消费者未按产品说明书、产品明示要求使用、维护、保管造成损坏的；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 2)消费者自己拆动或非承担三包修理者拆动造成损坏的；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3)无三包凭证及有效发票的；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 4)三包凭证载明的商品型号与修理商品型号不相符或三包凭证被涂改的。<br><br>（2）特殊商品退换货说明：以下情况商品不在退货、换货范围之内<br>&nbsp;&nbsp;&nbsp; a.无购物凭证及保修单、商品的外包装、附件、赠品（券）、说明书不完整，发票或销售小票缺失或涂改；<br>&nbsp;&nbsp;&nbsp; b.所退商品影响再次销售或商品附属物品不全等；<br>&nbsp;&nbsp;&nbsp; c.任何已使用过、已洗涤过，标牌已去除，包装已打开且无法再复原的商品不予退换；<br>&nbsp;&nbsp;&nbsp; d.任何因主观人为因素造成问题的商品（如非正常使用、保管和保养、不正确安装导致出现质量问题的商品，自行修改尺寸、洗涤、皮具打油、刺绣、长时间穿着等导致的损坏）；<br>&nbsp;&nbsp;&nbsp; e.商品使用期已超出“三包”期限的商品；<br>&nbsp;&nbsp;&nbsp; f.未经授权的维修、误用、碰撞、疏忽、滥用、进液、事故、改动、不正确的安装所造成的商品质量问题，或撕毁、涂改标贴、机器序号、防伪标记；<br>&nbsp;&nbsp;&nbsp; g.手机、数码、IT类商品通过软件升级可以排除的故障不属于三包范围内的故障，只要送至当地生产厂家指定或特约售后服务中心升级即可；<br>&nbsp;&nbsp;&nbsp; h.高端品牌箱包及饰品QC标签已损坏的；<br>&nbsp;&nbsp;&nbsp; i.礼包或套装中的商品不可以部分退货，因退货后，原礼包或套装中商品将无法享受购买时优惠。<br>&nbsp;&nbsp;&nbsp; j.图片及信息仅供参照，因拍摄灯光及不同显示器色差等问题可能造成商品图片与实物有一定色差，一切以实物为准。<br>&nbsp;&nbsp;&nbsp; k.无质量问题的下列商品（特殊商品）不予退换<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (a)直接影响人体健康的商品：食品、药品、保健品、烟酒、化妆品、洗涤洗护用品、美容美发用品、个人卫生护理用品等；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (b)泳装、内衣内裤、袜子等贴身用品；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (c)消耗类商品：音像制品、感光材料、打火机及消耗材料、电池等；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (d)属于构造比较复杂、精密，商场难以检测的商品（如摄像枪、照相机、电脑、手机、高档手表、数码视听等产品）；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (e)工艺品、金银珠宝饰品、眼镜、钟表等；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (f)高档服装类商品；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (g)婴儿用品、儿童玩具类商品；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (h)撕开剪断或其它现场标明的商品；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; (i)已安装的商品（如：空调、热水器、油烟机、灶具等）。<br><br>4、注意事项<br>&nbsp;&nbsp;&nbsp; 请您确保退换货时，商品吊牌、标签、收货单及各种包装完整，如购买时索要发票，一经退货请将发票随商品一同寄回，丢失或缺损将无法办理退换货。<br></p>', '0', '', '', null, null, null, '商品销售和售后服务', '1');
INSERT INTO `article` VALUES ('1312638051519852546', '2020-10-04 06:17:54', null, '0', null, '<p>网购商品所享受的售后服务，原则上与实体店购物的售后服务一致。建议客人可持商品及购物凭证到环市东店/小象电商outets购物中心的对应专柜处理，实体店接待网购商品的售后服务时，与实体店购买商品的售后服务原则一致。若客人不便亲临商店处理售后事宜，则按《小象电商网上商城退换货政策》操作。<br><br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; 退换货政策细则：<br><br>&nbsp;&nbsp;&nbsp; 以下类别商品自签收7日内，如商品未使用及包装保持出售时原状且配件齐全，我们将提供全款退换货的服务。退换货时，请您务必将保持完好的品牌包装、内带附件、标签、说明书等，如有发票或赠品需同商品一起退回。如商品包装破损或丢失，即便在退换货期内，也无法为您办理（质量问题除外）。我们将自收到退回商品之日起7天内返回您支付的商品价款，退回商品的运费由您承担。<br><br>&nbsp;&nbsp;&nbsp; 1.鞋靴类商品；<br>&nbsp;&nbsp;&nbsp; 2.箱包类商品；<br>&nbsp;&nbsp;&nbsp; 3.服装类商品；<br>&nbsp;&nbsp;&nbsp; 4.家居用品类商品；<br>&nbsp;<br><br>&nbsp;&nbsp;&nbsp; 以下类别商品快递公司配送到货后，请当面验货，一旦签收，无质量问题不予退换。<br><br>&nbsp;&nbsp;&nbsp; 1.内衣裤袜类产品；<br>&nbsp;&nbsp;&nbsp; 2.化妆品及个人护理产品； <br>&nbsp;&nbsp;&nbsp; 3.食品保健类商品；<br>&nbsp;&nbsp;&nbsp; 4.数码电器类商品；<br>&nbsp;&nbsp;&nbsp; 5.精品工艺类商品；<br><br><br>网购商品所享受的售后服务，原则上与实体店购物的售后服务一致。建议客人可持商品及购物凭证到环市东店/小象电商outets购物中心的对应专柜处理，实体店接待网购商品的售后服务时，与实体店购买商品的售后服务原则一致。<br><br>&nbsp;&nbsp;&nbsp; 若客人不便亲临商店处理售后事宜，则按以下流程操作。小象电商售后服务中心将为您提供优质、专业的售后服务：<br>&nbsp;&nbsp;&nbsp; （1）商品退换货政策<br>&nbsp;&nbsp;&nbsp; 自商品签收7日内，如商品及包装保持出售时原状且配件齐全，小象电商网上商城提供一次退换货服务。具体品类的退换货政策以《商品退换货政策》细则为准。<br>&nbsp;&nbsp;&nbsp; （2）售后服务流程说明<br>&nbsp;&nbsp;&nbsp; 售后服务包括商品退货、换货、维修、投诉四类。您可以在签收商品7日内，在线提交售后服务申请，填写相应的售后服务要求。收到您的申请后，我们的售后服务人员将与您联系，为您提供个性化贴身的售后服务。<br>&nbsp;&nbsp;&nbsp; （3）售后服务商品维修<br>&nbsp;&nbsp;&nbsp; 在线申请商品维修仅对三包期内小象电商网上商城出售的商品进行故障、损坏的维修。为了给您提供更完善的服务，服装类尺寸修改、数码类产品改装等个性化售后服务，请您带齐相关物品及票据亲临商场，我们将根据您的要求为您服务。<br><br>友情提示：<br><br>&nbsp;&nbsp;&nbsp; 一张订单只为您提供一次退换货服务。请详细阅读《小象电商网上商城退换货政策》细则后与我们联系；<br>&nbsp;&nbsp;&nbsp; 请您确保退换货时，商品吊牌、标签、收货单及各种包装完整，如购买时索要发票，一经退货请将发票随商品一同寄回，丢失或缺损将无法办理退换货；<br>&nbsp;&nbsp;&nbsp; 退换货发生时，请您选择普通快递将商品寄回给我们。因质量问题换货的商品将免费为您配送，礼包或套装中的商品不可以部分退货；如您购买时收到相关赠品，一经退货请将全部赠品一同寄回，并确保赠品包装完整且未使用，如丢失或损坏无法办理退换货。<br>&nbsp;&nbsp;&nbsp; 若非质量问题商品退换货需要寄回给我们，请根据申请单反馈的提示信息将商品以快递的方式发往小象电商网乐购（拒绝签收需到付的快递包裹）。我们收到包裹后，会对您退回的商品进行检测。如属于商品质量问题的，我们将根据您的要求对商品作退换或维修处理并返还您垫付的快递费用（请您注意使用合理的方式进行邮寄或快递，我们会根据运单金额实报，最高报销金额为15元），邮费将返还于您该单购物的原支付平台账户。<br>&nbsp;&nbsp;&nbsp; 我们会在收到您寄回商品后的2-3天完成质检，质检不符合退换货标准的，我们将会把商品原物寄还给您。<br></p>', '0', '', '', null, null, null, '退换货政策细则及流程', '1');
INSERT INTO `article` VALUES ('1312639740087922690', '2020-10-04 06:24:36', null, '0', null, '<p>&nbsp; 购物优惠及消费积分<br>（一）&nbsp;&nbsp; &nbsp;购物优惠<br>会员在本集团各商店购买以下类别的正价商品可享受即时折扣优惠以及其他非固定性的优惠和服务（视情况另行通知或公告）。具体规定的购物优惠折扣如下表：<br><br><img style=\"width: 618px;\" src=\"/upload/image/202010/02c8651a-a164-4c57-b65d-40718a13104e.jpg\"></p><p>注：<br>1、&nbsp;&nbsp; &nbsp;足黄金、足铂金、收藏品不享受会员卡优惠，消费额可按A类商品积分。<br>2、&nbsp;&nbsp; &nbsp;超市黄码纸商品等指定类别商品或特价商品不享受会员优惠，消费额1元积1分。<br>3、&nbsp;&nbsp; &nbsp;机团或特批商品购买可按“购物消费一元积0.1分”的标准由工作人员协助积分。<br>4、&nbsp;&nbsp; &nbsp;电脑、手机不享受会员优惠，不积分。<br>5、&nbsp;&nbsp; &nbsp;具体优惠情况以商场标示为准。<br>6、&nbsp;&nbsp; &nbsp;现场标示不接受会员卡的不列入。<br><br></p>', '0', '', '', null, null, null, '购物优惠及消费积分', '1');
INSERT INTO `article` VALUES ('1313652273095708673', '2020-10-07 09:28:03', null, '0', null, '<p>小象电商网乐购简介<br>———————————————————————————————————————<br>　　小象电商网乐购——国有大型综合性商业公司“小象电商集团有限公司”旗下的唯一官方购物网站。是小象电商商店特别为尊贵的顾客打造的一个一实体店为依托的在线购物消费平台。<br>&nbsp;<br>小象电商网乐购——作为集团公司五年发展战略规划中的一项重要创新举措，该平台率先导入3D全景现场模拟网络技术系统，通过广泛聚合各类商品资源、资讯资源和服务资源，为尊贵的顾客提供全方位覆盖各种生活消费需求的购物享受。同时，借助积分卡线上充值消费、在线查询终端、网上社区、POS机上门刷卡等多种渠道，突破了单一网络购物、单一线上支付的局限，以“四心”诚意帮助顾客实现在任何时间、任何地点、通过便捷渠道、以优惠的方式、购买到100%正品的购物梦想。<br>&nbsp;<br>小象电商网乐购——数百个品牌专柜、逾万款商品，囊括化妆品、家电、数码、服饰、钟表、珠宝、超市百货等18种百货商品类别，设有7种支付方式，并提供市内货到付款、省内满额免邮费、网上预售、积分卡充值线上消费等贴心服务。务求让您，超越时空，乐在其中。<br>&nbsp;<br>&nbsp;<br>小象电商网乐购“四心”<br>———————————————————————————————————————<br>“放心”<br>　　——实体店五十载信誉护航，线上线下情系小象电商<br>&nbsp;<br>小象电商网乐购是全国同行中，首个以实体商店为依托的网上商店，线上所售卖的商品皆可在小象电商环市东店中找到实件，顾客购买后还可亲自到店内验证、提取货品。作为小象电商历史最悠久的主力旗舰店，小象电商环东店通过完善而严密的商品采购、销售、售后服务保障制度以及对进货、经营、厂家等方面的严格监管，成为许多顾客心中商品质量保证的象征。在它的护航下，小象电商网乐购成为一个名副其实具有实体店保障的网上商店，带给顾客的不仅仅是商品正品质量的保证，还有如朋友、亲人般信赖的感觉。<br>&nbsp;<br>“称心”<br>　　——时尚精品荟萃，全方位覆盖时尚生活消费需求<br>&nbsp;<br>小象电商网乐购汇聚实体店内数百个品牌专柜、逾万款优质商品。主要包括男女服饰、工艺精品、手表、化妆品、箱包、日用家品、食品、厨卫器具、运动用品、家电、数码电子产品等品类。其中不乏潘多拉、碧玉丰、砖石世家等著名珠宝首饰品牌，圣宝龙、仕东利、佛伦斯、艾可儿、CYC等知名男、女装品牌以及TUMI、BCBG、OILILY等特色鞋包品牌，还有琳琅满目的超市食品、温馨别致的家居用品……等全方位满足客人衣、食、用、玩、礼品等各个方面的需求，组成一个全方位覆盖时尚生活消费需求的中高端在线百货商店。<br>&nbsp;<br>“开心”<br>　　——3D全景模拟小象电商环市东店，在网上也能逛小象电商<br>小象电商网乐购为了令虚拟空间与实体商店的融合更真切可感，在全国同行中，率先导入的3D全景现场模拟网络技术系统，真实还原了小象电商环市东店的全貌。顾客只需跟随着屏幕上的箭头指引，轻点鼠标，便彷如置身在小象电商环市东店内，遇见心仪的服饰，还可点击试穿、随心搭配，充分享受在网上也能逛小象电商的全新购物乐趣。<br>&nbsp;<br>“贴心”<br>　　——高效、优质的在线服务体系，“一对一”的互动体验<br>&nbsp;<br>小象电商网乐购为宾客提供的在线服务，除了秉承实体商店里的专业与优质，还将充分发挥网上商店的网络优势。小象电商网乐购不仅设有预订、选购、支付、售后送货的一条龙服务，还提供在线客服咨询、丰富的专题商品在线推介、优质的品牌历史文化介绍、生活小常识等信息交流，如需要进一步了解商品详情，各大品牌还特别开通了品牌专有的一对一在线客服，宾客可通过语音、视频等网络通讯工具直接“面对面”地咨询和“零距离”观察到详尽的商品信息，增添了在线购物的互动性和真实性，使购物旅程更加智能化、个性化。<br>&nbsp;<br>另外，小象电商网乐购还特别为尊贵的VIP顾客量身定制了VIP、机团客户尊享服务，以及VIP绿色通道、机团特色服务和小象电商积分卡支付等作为小象电商网上商店的特色服务措施，之力为小象电商的宾客们提供无微不至、独一无二的网购体验。<br>&nbsp;<br>特色服务链接<br>———————————————————————————————————————<br>【VIP专用通道及机团客户向导】<br>小象电商网乐购特别为小象电商VIP设置专用通道，可在线自查积分、更新个人资料。针对机团客户（礼品）设置的导购助手功能，结合电话、传真、QQ等通讯工具提供即时、细致的购买向导服务，让客人充分感受到小象电商专业、贴心的高品质服务。<br>&nbsp;<br>【网乐购尊享日】<br>小象电商网乐购与小象电商环市东店定期同步举行小象电商VIP尊享日活动，更有别于实体门店的优惠酬宾。活动期间没有营业时间限制，不需排队等候付款，不用长途跋涉提货归家，让尊贵的您更加轻松自由地尽情购物，超越时空，乐在其中！<br>&nbsp;<br>【积分卡快递服务】<br>小象电商网乐购推出了个人或机团在线购买小象电商积分卡、特色礼品组合的绿色通道，积极开设积分卡网上订购快递服务，打破积分卡销售地域限制，并提供积分卡网上充值消费，顾客可通过网上咨询、选购、预订、支付、预约送货等一条龙服务，让购买更有效率。<br>&nbsp;<br>【线上充值、上门刷小象电商积分卡】<br>小象电商网乐购除了支持货到付款、网银在线支付、邮局汇款、帐户余额支付等支付方式外、还将为需要以小象电商积分卡支付货款的客人，提供预约积分卡货到刷卡付款的服务。另外，新版小象电商积分卡（背面有可刮开涂层），提供积分卡线上充值消费，切实让顾客足不出户也能体验到超越时空的购物乐趣。<br>&nbsp;<br>【心水商品专题推介】<br>针对不同节日及网上活动，定期推出心水商品专题推介，一站式解决顾客购物送礼需求，绝对是尊贵的宾客日常必备的电子杂志周刊。<br>&nbsp;<br>【更多特色服务】<br>依托实体商店、100%正品保证；<br>&nbsp;<br>优质贴心服务、专人在线导购；<br>&nbsp;<br>多种支付方式、轻松快捷购物；<br>&nbsp;<br>市内货到付款、优质安全配送；<br>&nbsp;<br>购物满500元、省内立免运费。<br>&nbsp;<br>超越时空，乐在其中<br>　　我们将竭力为顾客您提供无微不至、独一无二的网络购物体验，让您足不出户也能够体验尊贵，共享小象电商！小象电商网乐购，超越时空，乐在其中！<br>&nbsp;<br>&nbsp;<br>小象电商网乐购定期推出惊喜单品、心水专题。更多精彩体验请登录小象电商网乐购或关注新浪微博<br>@小象电商商店官方微博和@小象电商网乐购<br></p>', '0', '', '', null, null, null, '关于我们', '8');
INSERT INTO `article` VALUES ('1313652719059275778', '2020-10-07 09:29:49', null, '0', null, '<p>联系地址：深圳市环市东路369号 小象电商网络销售部　邮编：510095<br>咨询及投诉电话：020－0000000<br>邮箱：cgzfs@qq.com<br><br>小象电商各门店咨询服务热线：<br>环市东店<br>服务台：83483101&nbsp; 导购：83483321<br>客服机团：83483105&nbsp; 客服中心：83483108<br><br>时代店<br>咨询投诉服务热线：020-38820158<br>机团购买服务热线：020-38820152、38820125<br><br>正佳店<br>咨询投诉服务热线：020-38331868<br>机团购买服务热线：020-38331830<br><br>国金店：<br>咨询投诉服务热线：020-88832222<br>机团购买服务热线：020-88832333<br></p>', '0', '', '', null, null, null, '联系我们', '8');
