INSERT INTO `brand` VALUES ('555', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '卡西欧电子(深圳)有限公司成立于1996年，主要在国内销售卡西欧高科技电子腕表。将高、精、尖的先进科技结合新型液晶技术，恰当地运用于腕上时计,卡西欧电子(深圳)有限公司积极在国内推广集多功能与新时尚为一体的运动休闲手表品牌G-SHOCK/Baby-G，经过市场开拓期的品牌塑造活动，在年轻人中已广受欢迎，成为新潮、时尚、高科技、功能多元化的电子腕表的代名词。除了G-SHOCK/Baby-G之外、还经营包括PROTREK、SEA-PATHFINDER等多个品种的多功能电子腕表，在市场中以其先进的数字技术运用而颇受欢迎。', null, '卡西欧', '1', null);
