INSERT INTO `brand` VALUES ('564', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'Private Shop於1994年在香港成立，由美国吉时兄弟 (香港) 有限公司全资拥有，是香港首屈一指售卖欧美高级名牌内衣的专卖店，负责零售、营运、市场行销及分销欧美品牌内衣產品。Private Shop旗下的内衣品牌强调款式、质料及舒适度的全面结合。除内衣外，各专卖店还出售睡衣、家居服、泳衣、内衣配件等產品。如今Private Shop在中国共有25间专卖店，遍佈於香港、澳门以及大陆多个主要城市，大陆地区的14家店铺覆盖北京、上海、深圳、深圳、沈阳、太原、杭州、苏州、重庆和成都。', null, 'PrivateShop', '1', null);
