INSERT INTO `brand` VALUES ('569', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '“汉盅补”是香港泽思公司独家代理的世界著名中药及滋补品牌，有着多年盛名历史和品质信誉保证。目前已在香港、北京、上海、深圳、佛山、昆明等全国各大城市著名商场设立品牌专柜，主要经营燕窝、虫草、高丽参、参茸、海味等高级滋补品。\r\n', null, '汉盅补', '1', null);
