INSERT INTO `brand` VALUES ('605', '2020-09-22 06:26:31', '2020-10-07 11:39:57', '1', '1', '★cottonfield是中国第一家毛巾品牌，也是国内目前唯一具备同国际一流产品进行竞争的品牌。产品有近百种系列，上千个花色。古朴典雅的东方气息，豪迈自然的欧美风格，跳跃明快的青春时尚，动感自如的运动休闲，迎合着不同人士的选择。', '/upload/image/202010/b4400432-db62-4207-8f55-acaa5c932850.png', '棉田', '1', null);
