INSERT INTO `brand` VALUES ('617', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '「AIRLAND」雅兰凭借这个意念，以「为消费者奉献最舒适健康和高品质的寝具」为追求目标，呈献精心制作、高雅舒适的家居用品，让讲究生活质素的人士，轻松享受到无可比拟的优质睡眠，让和谐自然的生活恒久拥有！\r\n\r\n自1966年在香港成立，「AIRLAND」雅兰经过四十多年来不断努力，已成功发展为涵盖家居用品（主要为床垫及床上用品）生产经营、地产开发、酒店经营管理、电力发展及玩具生产经营等制造行业于一身的集团公司。\r\n\r\n本着「品质第一，弘扬名牌，科技兴业，共创未来」的经营方针和理念，我们一直专心致志地生产并销售优质床垫、床上用品等品质超凡的家居用品。\r\n', null, '雅兰', '1', null);
