INSERT INTO `brand` VALUES ('634', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '雅芳婷布艺实业（深圳）有限公司隶属香港雅芳婷集团，是专业从事床上用品研发、生产、销售、服务的大型家纺企业。早在1979年进驻深圳特区，成为首批在深圳投资的外资企业之一。企业以“创新、品质及以人为本”为品牌核心价值，靠的是“注重品质，提升管理”的策略，走的是“品质求生存，创新谋发展”的道路。企业凭借良好的品牌声誉，吸引了高素质的生产队伍、优秀的管理人才、卓越的营销团队。生产规模、经济实力、产值、利润和税缴等各项指标逐年大幅增长。在新技术开发应用、创新产品、提升品质、增加科技含量等方面均位于行业领先地位。营销版图从香港、澳门、中国大陆扩张至东南亚及欧、美、加等国家地区，并拥有近400个零售网点。', null, '雅芳婷', '1', null);
