INSERT INTO `brand` VALUES ('645', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '？ 佳能公司自1937年创业以来，始终以创造世界一流产品为奋斗目标，积极推动事业向多元化和全球化发展，其研发、生产以及销售活动在全球展开，并通过在美 洲、欧洲、大洋洲、亚洲和日本地区建立区域性总部，展开全球化多种经营战略。 目前，佳能在全球以光学为核心的个人消费产品、办公产品以及工业产品等领域发 挥着巨大的作用。\r\n？？？？？？？ 基于“共生”理念，1996年，佳能启动旨在实现以技术服务社会，成为全球范 围内被信赖、受尊敬的企业这一目标的“全球优良企业集团构想”，积极推行“整 体最佳”和“重视利润”的意识改革和经营革新活动，构建了今日佳能的企业体制。\r\n？？？？？？？2010年佳能集团营业额达到457.64亿美元（此数据截止至2010年12月31日）。由于连续几年的出色业绩，佳能于2009年被《商业周刊》杂志列入“全球最佳品牌”第33位。目前分布在世界各地的合并结算子公司已达241家公司，员工168,879人（此数据截止至2009年12月31日）。\r\n？？？？？？？ ', null, '佳能', '1', null);
