INSERT INTO `brand` VALUES ('674', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'SEIKO（精工），唯一拥有各种腕表制造技术的腕表制造集团\r\n    SEIKO（精工）的传奇，是一个勇于梦想的公司，以坚定意志和实力去完成貌似不可能的任务的传奇。经过130年的历程，SEIKO（精工）一直勇于挑战和实现那些曾经看起来遥不可及的梦想，那些在技术上的，商业上的和环境保护上的梦想。\r\n在制表技术领域内，公司实现梦想的决心是显而易见的。特别是，SEIKO（精工）始终为了成为制表业界的科技先锋而奋斗，并致力于扩大制表技术领域。这种对新目标不懈地追求使SEIKO（精工）至少掌握了不少了4种专业的制表技术，分别是融入了高精密度和传统工艺的机械表制造技术、由SEIKO（精工）发明和改革的石英表制造技术、由佩戴者手臂摆动产生并储存电能，为腕表提供动力的Kinetic（人动电能）技术以及奢华制表工艺“宁静的革命”Spring Drive技术，其中Kinetic（人动电能）和Spring Drive是SEIKO（精工）独一无二的技术。', null, '精工表', '1', null);
