INSERT INTO `brand` VALUES ('676', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '深圳金碧玉首饰有限公司是一家集工艺、美术设计、致力弘扬中华民族传统玉文化的民族企业。成立于1989年,前身是深圳金碧玉首饰工艺厂，秉承历代先辈的经验与技艺，公司目前拥有三百多平方米的办公场所，一千多平方米的厂房及一大批先进的工艺设备，并有200多名集工艺、美术设计于一身的技艺大师，十多名经验丰富的专业技术人员长驻原翡翠产地缅甸仰光及云南藤冲选购天然优质石料，使优良的产品原料得以保证。\r\n    深圳金碧玉首饰有限公司经营多种传统、现代艺术及传统与现代艺术相结合的精美珠宝玉石产品--天然缅甸翡翠：手镯、花件、笑佛、金银首饰、镶嵌翡翠、和田玉、钻石等；并注册使用“翠丽”商标向市场推行。“翠丽”产品全部交由国家技鉴部门检测后上市，每件产品附检验鉴定证书。公司以“成就国内优质知名品牌”为目标，倡导“质量保证，信誉第一”的企业精神。  公司以完善的服务管理体系，以展开开拓创新的精神，经过不懈的努力，销售网点遍布全国大中城市，取得骄人的销售业绩并获得广大消费者的一致好评和赞赏。', null, '翠丽', '1', null);
