INSERT INTO `brand` VALUES ('679', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '诺基亚（Nokia）公司成立于1865年，经历一个半世纪的发展后，成为世界上最大的通讯设备供应商。诺基亚是移动通信的全球领先者。凭借经验丰富、创新、用户友好以及可靠的解决方案，诺基亚已成为移动电话的领先供应商，同时也是移动、固定宽带和IP网络的领先供应商之一。通过将移动性和互联网的有机结合，诺基亚不仅为企业创造了更多的商业机会，也使人们的日常生活更加丰富多彩。诺基亚股票在全球五个主要证券市场上市，股东遍布世界各地。', null, '诺基亚', '1', null);
