INSERT INTO `brand` VALUES ('710', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '(OSIM International) 由集团主席沈财福博士于1980年所创立。公司的前身是一家贸易商店，主要是售卖厨房电器和家庭用品。之后，公司开始售卖两种保健产品 - 手提按摩器和反射区滚轴。1987年，公司扩大业务和销售网络，在新加坡、中国香港和中国台湾等市场开设10个分销点，销售家庭用品和保健产品。 　　1980年代末，公司建立自身品牌 \"OSIM\"，并通过合同制造以及合资生产的方式， 生产多种 OSIM 品牌的保健产品。\"OSIM\" 品牌是由沈财福博士所创造的，其中\"O\" 象征着地球，而\"SIM\" 则是他的，\"OSIM\" 的含意是要把本身的品牌推向全世界的市场。 　', null, '傲胜', '1', null);
INSERT INTO `brand` VALUES ('711', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '    生命动力(香港)有限公司成立于1997年；公司专注于设计、研发、制造、销售按摩椅及健康按摩器材。前身是利平电器工程公司，70年代成立于香港；公司主要为大型生产企业设计、安装自动化机械及电脑控制设备。\r\n\r\n    生命动力与德国汽车零件供应商SUSPA公司合作，将汽车工业技术结合人体工程学原理应用到按摩椅的研发设计里面，令按摩椅更附合人性化、按摩感觉更舒适、按摩更到位，并采用了Six Sigma（六西格玛）国际最先进的管理系统，优化和提升了企业在研发、制造、品质等方面的技术和质量，引领按摩健康产品走向卓越！\r\n\r\n    1999年，公司扩大规模，将生产基地迁至有“世界工厂之都”的广东东莞并成立“东莞市生命动力按摩器材有限公司”。\r\n\r\n    生命动力自成立以来，坚持以“持续创新、创造不同”为企业的经营理念，以“简约、时尚、舒适”的产品设计风格，致力研发出更优质舒适的按摩产品，并在业界首位取得了”香港工业设计奖”、 “中国创新设计红星奖”等相关荣誉。我们会坚守企业使命，“用创意与科技将健康带进每个家庭”！\r\n\r\n\r\n    \r\n', null, '生命动力', '1', null);
