INSERT INTO `brand` VALUES ('724', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '   具有近百年历史的全球家用电器领先品牌惠而浦家电集团创立于1911年，总部位于美国密歇根州的奔腾港，是世界上最大的大型家用电器制造商，亦是美国《财富》杂志全球500强企业。 \r\n   惠而浦家电集团旗下拥有Whirlpool, Maytag, KitchenAid, Jenn-Air, Amana,Brastemp和Bauknecht等众多著名国际品牌，业务遍及全球170多个国家和地区在全球拥有73,000名员工。  \r\n   作为世界上唯一一家专注于全系列大型家用电器的制造商，惠而浦致力于为全球消费者提供品质卓越的家电产品,其产品涉及洗衣机/干衣机、微波炉、冰箱、空调、灶具抽油烟机、洗碗机、油热汀及家庭厨房垃圾处理机等9大系列，年销售额高达180多亿美元,01-09年连续9年全球销量第一。\r\n', null, '惠而浦洗衣机', '1', null);
