INSERT INTO `brand` VALUES ('731', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '上海三菱电机.上菱空调机电器有限公司（简称SAEC）是三菱电机株式会社和上海电气实业有限公司共同出资组建的中日合资企业，作为三菱电机在全球的四大空调生产基地之一，也是在中国唯一的空调生产基地。三菱电机以创新的技术和人性化的高品质产品领衔业内，致力于为人类创造更舒适的生活环境，全面开发了从家用到商用的空调系列产品，三菱电机空调正在以出色的技术和卓越的性能，成为业界值得信赖的品牌。', null, '三菱电机空调', '1', null);
