INSERT INTO `brand` VALUES ('787', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '品牌介绍\r\n\r\n\r\n皇冠1952年诞生于台湾，经过江氏兄弟的精心经营，80年代 成为享誉全球的经典品牌，在精工制造的基础上，追求完美细节，其一流的设备、严格的质量检测及全球服务支持的质量保证，使其产品成为旅行用品的优秀典范；箱包产品畅销海内外40多个国家。半个多世纪的辉煌路，皇冠致力于推动箱包行业国际时尚流行趋势，并以箱包研发、生产、销售服务系统为中心，建立了亚洲最大的箱包生产基地，并逐步形成房产、休闲娱乐多行业于一体的大型集团公司。\r\n\r\n\r\n', null, '皇冠', '1', null);
