INSERT INTO `brand` VALUES ('810', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '英国Aquascutum雅格狮丹于1851年在伦敦创立，品牌一向采用英伦式的优秀剪裁技巧和布料，配以专有格子图案，设计出经典时尚的男女服饰。以原创军用大衣享负盛名，拉丁文「Aquascutum」的意思是「水的防御物」。', null, '雅格狮丹', '1', null);
INSERT INTO `brand` VALUES ('811', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '　　BOSSsunwen品牌传承发展，于二十世纪七十年代由创始人MR.SUNWEN在英国伦敦所创立。品牌传承发展，已成为能为全世界每一位现代男士提供设计精湛工艺考究的“典雅、时尚、商务”服装&配饰的品牌公司。如今，由法国设计师JEROME BLOCH担任品牌设计创意总监的BOSSsunwen品牌，仍秉承着BOSSsunwen品牌所特有的正统与休闲相结合的设计风格，崇尚优雅舒适、自热从容的生活理念，每一款产品都尽力追求品牌与内涵的极致，其产品线囊括了西装、夹克、大衣、皮衣、衬衣、T恤、休闲裤、皮鞋、皮具等600多个品类，真正地实现了一牌多品的品牌经营理念。\r\n', null, 'BOSSsunwen', '1', null);
