INSERT INTO `brand` VALUES ('819', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '   “HOPTAHE”是“成功”的同义词。从工作中诠释“成功”，如图与奋斗是“HOPTAHE\"的脊梁，它是精于敏锐思考的、它是沉稳面睿智的、它是善于以静制动的；它是自由的、它是洒脱的、它是自己的。\r\n    年龄定位28-45岁，有时尚触觉、生活品味；渴望成功、希望展现自我与获得关注，追求个性、健康的现代时尚商务人士。\r\n    简约面不简单，于细节处彰显品味，时尚度与舒适度并重是“HOPTAHE”品牌的风格。也是其产品体系创建的基础。', null, '埃驰易', '1', null);
INSERT INTO `brand` VALUES ('820', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'STONNIE 品牌起源于欧洲，1996年正式进入亚洲市场。 是由意大利著名服装设计师 Mr. Franco Ferraro 通过香港设计中心的资源交流平台，对东方人体体型及传统文化进行深入的了解与研究，并将意大利经典的着装风格与时尚元素很好地溶入到其中，创造出了 STONNIE 品牌特有的设计风格和品牌文化。\r\n\r\n好的品质源于一丝不苟的专业精神，Mr. Ferraro 在整个系列开发过程当中，时刻紧贴潮流资讯，保持与世界顶级面料和辅料供应商的紧密合作（如：“PIACENZA”、“LORO PIANA”、“BOTTO POALA”、“COCLOMBO”等），这些供应商所生产的高品质面料为“STONNIE”的产品提供了优质的保障。至于与各大制作工厂的创研合作，更是从无间断，在剪裁、洗水等工艺中都不停注入崭新的科技元素，力求于细微之处见品味，创造出与众不同的视觉效果，带给我们一种全新的 STYLE LABORATORY（潮着实验馆）概念。\r\n\r\nSTONNIE 系列产品以商务休闲为核心，设计独具匠心，既捕捉世界潮流，又结合中国人独特的品味，让你在时尚潮流中尽显自己独特的魅力。', null, '仕东利', '1', null);
