INSERT INTO `brand` VALUES ('832', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'B.LEMAN（中文：贝利龙），是意大利贝利龙集团（国际）有限公司旗下品牌。\r\nB.LEMAN，一个由国际设计师团队打造的高端男装品牌，其设计风格始终传承“品质与简约集一身，个性与时尚成平衡”的设计理念。在为社会名流设计社交礼服和生活便服的丰富经验中，由于B.LEMAN设计团队的作品总能在一种“最本质的简约 ”中表露男装的时尚美感，因而很快赢得了世界品位之士的青睐和推崇。\r\n 现在，B.LEMAN设计师于世界各地快速敏锐地捕捉最新时装趋势和潮流，并在设计总部汇总、分析，再设计出潮流时尚，独具风格的款式。无论是对高科技面料的运用、款式图案的搭配，还是精细的工艺，都代表了欧洲潮流的典范，同时保留了简约奢华的设计风格，更显男人独特魅力。\r\n', null, '贝利龙', '1', null);
