INSERT INTO `brand` VALUES ('952', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'Dior迪奥，法语中“上帝”与“金子”的组合，一位无懈可击的时尚缔造者，一个万众瞩目的香氛品牌，一个高贵、典雅女性的象征。这个由同名时装设计大师创造、鲜明代表法国高贵典雅生活风格精华的品牌，半个多世纪以来，在时装、香水、彩妆和护肤领域，一直致力于全方位聆听女性心声，演绎了现代女性的梦想——性感自信，激情活力，时尚魅惑！', null, '迪奥', '1', null);
INSERT INTO `brand` VALUES ('956', '2020-09-22 06:26:31', '2020-09-23 03:46:23', '2', '1', '1935年由著名调香师Armand Petitjean创办的Lancome兰蔻，现已成为引领潮流的护肤化妆品牌。Lancome在法国拥有一座设备完善与现代化的实验室，每年研制出先进的技术和产品，迎合每位爱美女性的需求。Lancome曾经将科技工业界的先进输送系统，如Lipsome微脂囊和Nanocapsule毫微胶囊分子率先运用在护肤品当中。Lancome的护肤理念是：首先了解皮肤的特性和新陈代谢情况，然后研制和肌肤最相近及可加强肌肤天然功能的护肤品。', '/upload/image/202009/a849ce7f-c8f4-483b-ad83-ea5db0591198.jpg', '兰蔻', '1', null);
INSERT INTO `brand` VALUES ('957', '2020-09-22 06:26:31', '2020-10-07 11:22:31', '1', '1', '拥有非凡身世的美丽奇迹LAMER，在法文里，代表“海洋”，LAMER海蓝之谜。在它的众多拥戴者心目中，意味着谜一般的美丽能量。这罐来自海洋，以海洋命名的传奇面霜，仿佛蕴含着开启青春美丽的玄机，就像一瓶“小小的奇迹”。这款集合了太空物理学家MaxHuber多年心血的完美面霜，奇迹般地治好了MaxHuber博士面上被火箭料爆炸严重灼伤的疤痕，更逐渐使受损肌肤恢复到了难以想象的细致平滑。神秘的独门配方，成就令世界疯魔的奇迹来自海洋的神奇活性精萃。', '/upload/image/202010/c1a52371-0f41-4f0b-9610-f0f87a567927.jpg', '海蓝之谜', '1', null);
