INSERT INTO `brand` VALUES ('973', '2020-09-22 06:26:31', '2020-10-08 09:32:06', '2', '1', '1946年，雅诗兰黛夫人凭借着想为每个女性带来美丽的渴望创立了雅诗兰黛ESTEE LAUDER品牌。历经半个多世纪，它以领先科技和卓越功效在全球赢得广泛美誉。如今，雅诗兰黛的护肤、彩妆及香水产品系列已在全球130多个国家销售。坚持为每个女性带来美丽的初衷、致力于科研的突破和创新、保持与顾客良好的交流，这些优秀传统延续至今并成为未来发展的宝贵基础。', '/upload/image/202010/0dab2254-6ccd-429f-99ff-50e07a4182b7.jpg', '雅诗兰黛', '1', null);
INSERT INTO `brand` VALUES ('983', '2020-09-22 06:26:31', '2020-10-07 11:29:03', '1', '1', '源自法国的植物美容学先驱Sisley希思黎，是享誉全球高端奢侈护肤品领域的经典品牌。拥有专业实验室，逾30年植物研发经验，打造完美品质的产品，成就安全、自然、有效的承诺。从面部护肤、男士护理，到植物彩妆、艺术香氛，成就完整的希思黎品牌系列。', '/upload/image/202010/f8001fb4-b2f3-40e1-9ff6-e7e502446ff6.jpg', '希思黎', '1', null);
INSERT INTO `brand` VALUES ('1004', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'OLAY玉兰油，是中国区最大护肤品品牌，在大陆已持续十年呈两位数增长。它是宝洁公司全球著名的护肤品牌，OLAY以全球高科技护肤研发技术为后盾，在深入了解中国女性对护肤和美的需要的基础上，不断扩大产品范围，目前已经涵盖了护肤和沐浴系列，真正帮助女性全面周到地呵护自己的肌肤。如今，玉兰油全球销售额近十亿美金，成为世界上最大、最著名的护肤品品牌之一。', null, '玉兰油', '1', null);
INSERT INTO `brand` VALUES ('1005', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '源自1902年的世界顶级化妆品牌HR赫莲娜，品牌致力于服务那些期望获益于先进科技成果、体验明日美容领域惊人成就的女性。在国际最具实力的美容科技研究实验室的支持下，始终以“护肤先端医学高科技，彩妆领先时代新理念”为品牌理念，不论是融汇最先进的医学、整形外科科技的突破性护肤产品、体现独特护肤理念的“个性化护肤方案”――均衡调理方案和深度修护方案、或是凝聚卓越科技成果、高贵包装、丰润质感和新颖创意于一身的潮流化妆品，HR赫莲娜凭籍其前瞻性视野，开拓潮流新路向，为未来美容护肤奠定新标准。', null, '赫莲娜', '1', null);
INSERT INTO `brand` VALUES ('1006', '2020-09-22 06:26:31', '2020-10-07 11:26:56', '1', '1', 'KOSE高丝创立于1946年，现为日本第二大化妆品公司，以质量著称于日本，获得了日本化妆品行业的第一也是目前唯一的质量管理最高奖项“戴明奖”。发展至今，目前集团旗下共拥有KOSE高丝、COSMEDECORTE黛珂两大品牌，共计18个系列的商品。还有AVENIR艾文莉和BEATY DE KOSE美谛高丝、雪肌精、贝缔雅、葛伦戴娜、娜蔻、润肌精、兰皙欧等品牌，满足消费者日益增长的个性需求。\r\nKOSE秉承“融合知性与感性，创造独特美的价值和文化。”的企业存在理念，在传承“专业化妆品制造者”精神的同时，努力将自身发展成为以美为中心并向纵深化发展的多品牌企业。KOSE以缔造美好生活作为发展的远景，旨在成为融入女性的梦想并且创造女性生活文化的企业。', '/upload/image/202010/1a560de4-6f96-43b5-a56b-c658f4b668b3.jpg', '高丝', '1', null);
INSERT INTO `brand` VALUES ('1024', '2020-09-22 06:26:31', '2020-10-07 11:22:55', '4', '1', '<p>CLARINS娇韵诗，因爱而美丽！Clarins研发了一系列拥有完美效果与愉悦质地的产品，以植物为主的产品，含有特別挑选且经过实效证明的完美成份。Clarins提供脸部与身体的美容护理，高效的防晒产品与完整的彩妆系列。不论您的需求为何，都能找到适合您使用的产品。娇韵诗的口号一直是“It is a fact，with Clarins，life is more beautiful”，娇韵诗的CEO，Christian Courtin Clarins表示他们这么说是有充分的技术支持的，因为他们的护肤技术研究水平领先其他的品牌至少10 年。对于现在各大品牌都纷纷推出天价昂贵护肤品的趋势，Clarins 先生表示：娇韵诗一贯的品牌哲学就是给女性更多的爱和关心，而给化妆品制定如此昂贵的价格显然是不啻于对女性朋友的剥削。娇韵诗则会一贯秉承用优质的原料作出最优质的产品，全面护理女性的脸和身体。”</p><p><br></p>', '/upload/image/202009/4687816a-a98d-4550-8aa8-96b55b749304.jpg', '娇韵诗', '1', null);
INSERT INTO `brand` VALUES ('1025', '2020-09-22 06:26:31', '2020-09-23 03:51:11', '1', '1', '自1828年起，GUERLAIN法国娇兰，就专注于女性美容领域。创始人PIERRE FRANCOIS PASCAL GUERLAIN当时就以效果出色、稀有天然的原材料研究创造护肤美容业的产品。GUERLAIN始终以激情为动力，坚持对卓越的不断追求。今天的GUERLAIN，依然奢华、高贵、优雅，带着充满传奇的美丽，走入你的生活。', '/upload/image/202009/a4b5e1d0-910f-47e2-a80e-f99a9287f6fb.jpg', '娇兰', '1', null);
