INSERT INTO `brand` VALUES ('1046', '2020-09-22 06:26:31', '2020-10-07 11:29:41', '1', '1', '资生堂Shiseido日本著名化妆品品牌。取名源自中文《易经》中的“至哉坤元，万物资生”，资生堂的涵义为孕育新生命，创造新价值。“至哉坤元，万物资生”意为“赞美大地的美德，她哺育了新的生命，创造了新的价值。”这一名称正是资生堂公司形象的反映，是将东方的美学及意识与西方的技术及商业实践相结合的先锋。将先进技术与传统理念相结合，用西方文化诠释含蓄的东方文化。', '/upload/image/202010/cad64824-a27b-43cf-b0d6-d3566ce9ba0a.jpg', '资生堂', '1', null);
