INSERT INTO `brand` VALUES ('1056', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'SK-II，护肤保养品的灵感来自清酒酿制场里年老女工那双幼滑年轻的手。科学家惊讶于女工们脸上满布皱纹，双手却很幼滑，领悟出女工们经常参与清酒酿制程序有助保养肌肤。他们从天然酵母发酵过程中提炼功效神奇的Pitera活细胞酵素精华。SK-II的保养品蕴含Pitera活细胞酵素精华、健康皮肤不可缺的氨基酸、矿物质、有机酸及无机酸等自然成份。SK-II出品的护肤精华Facial Treatment Essence非常有名，有“神仙水”之称，含高达90% Pitera成分，促进肌肤自然再生循环，滋润多油或干燥部位。', null, 'SK-Ⅱ', '1', null);
INSERT INTO `brand` VALUES ('1063', '2020-09-22 06:26:31', '2020-10-07 10:54:02', '1', '1', '膳魔师（中国）家庭制品有限公司 Thermos (China) Housewares Co. Ltd. (简称TCC) ，系享誉国际已百年之全球最大知名高真空系列产品品牌THERMOS（膳魔师）家族的一员。于1995 年由港，日合资，进入中国市场。膳魔师（中国）家庭制品有限公司产品主要有高真空不锈钢保温杯、保温瓶、保温壶、保温罐、焖烧锅等高品质保温系列产品以及以高TCC科技太空技术研发的各式复合金炒菜锅、汤锅锅具系列等等之家庭厨房系列用品。', '/upload/image/202010/48d56fe6-22f1-4c88-bfc1-423ee91df561.jpg', '膳魔师', '1', null);
INSERT INTO `brand` VALUES ('1103', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '步步高在教育电子始终致力于电教产品的研发、生产、销售和服务，产品涵盖学习机、电子辞典、点读机、复读机、早教机等多个品类。经过十多年的发展，步步高教育电子从行业中脱颖而，产品深受消费用者青睐，销量稳居行业前列。\r\n公司以优良的产品品质和完善的服务体系享誉市场，品牌声誉日渐提高，先后荣获得多英荣誉称号。', null, '步步高', '1', null);
INSERT INTO `brand` VALUES ('1104', '2020-09-22 06:26:31', '2020-10-07 14:33:48', '1', '2', 'OPPO是一家全球注册，集科研、制造和营销于一体的大型高科技企业，产品远销香港、美国、俄罗斯、欧洲、日本、韩国、东南亚等市场。OPPO公司先后成功推出MP3、MP4、蓝光DVD、手机等产品，现正致力于智能手机、3G手机、平板电脑的研发。OPPO公司凭借雄厚的自主研发能力，在品质表现上力求完美，在产品造型设计上力求时尚精美，在功能操作上力求简洁易用。OPPO致力于打造高品质时尚数码行业的国际一流品牌。', '/upload/image/202010/c2c7ad04-cb82-43d7-bba4-2600ce13c707.jpg', 'OPPO', '1', null);
