INSERT INTO `brand` VALUES ('1126', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '日本玻璃王产品主要分为咖啡具系列、茶具系列、水瓶系列、厨房用具系列。产品玻璃采用100%纯天然的、耐热的安全玻璃材质制造，玻璃耐高温性强，设计新颖而实用，是现代家庭必备之选。', null, '日本玻璃王', '1', null);
INSERT INTO `brand` VALUES ('1127', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '2', '陆宝乐活陶瓷，采用释放能量之天然矿土，创造一系列有益人体健康的能量陶瓷。陆宝持续用心创作每个作品就是为了用这项泥土和火焰结合的艺术让每个人自然健康，品味生活。', null, '台湾陆宝茶具', '1', null);
INSERT INTO `brand` VALUES ('1128', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '华人世界精品第一品牌 FRANZ\r\n\r\n法蓝瓷成立于2001年，生产基地位于千年瓷都景德镇，成立来年即光芒初露，荣获「纽约国际礼品展首奖」。法蓝瓷结合东方美学思考与西方新艺术装饰风格，精致地表现出融合浮雕与雕塑的立体造型和浪漫梦幻的丰富色彩。\r\n\r\n法蓝瓷采用独家专利「倒角脱模工法」，与特制釉下彩技术，并以手工绘制，作品历经上百道工序才得以完成。中西合璧的设计风格，广受世界各地喜爱，目前在全球已有六千多个销售据点，多次获选为国礼并获国家领导人高度重视。', null, '法蓝瓷', '1', null);
INSERT INTO `brand` VALUES ('1129', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'HP = Hewlett-Packard Development Company, L.P.，惠普研发有限合伙公司，　HP来源于惠普两位创始人的姓氏  hp的LOGO\r\n[1]　1939年，在美国加州帕洛阿尔托市(Palo Alto)爱迪生大街367号的一间狭窄车库里，两位年轻的发明家比尔.休利特（Bill Hewlett）和戴维.帕卡德（David Packard），以手边仅有的538美元，怀着对未来技术发展的美好憧憬和发明创造的激情创建了HP公司，开始了硅谷的创新之路。 　　惠普研发有限合伙公司（Hewlett-Packard Development Company, L.P.）（简称HP）（NYSE：HPQ）位于美国加州的帕罗奥多，是一间全球性的资讯科技公司，主要专注于打印机、数码影像、软件、计算机与资讯服务等业务。2002年收购了美国著名的电脑公司康柏电脑（2001年9月4日宣布收购， 2002年5月3日完成收购），2010年收购了美国著名智能手机界的元老--Palm公司。 　　中国惠普有限公司总部位于北京，在上海、深圳、沈阳、南京、武汉、西安、成都和深圳设有分公司。', null, '惠普', '1', null);
INSERT INTO `brand` VALUES ('1135', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '深圳市天信有限公司成立于1996年，“茗艺の国”是公司产品的注册商标。本公司位于深圳荔湾区南方茶叶市场中心馆三楼，是一家以经营中高档茶产品、茶器具为主的专业连锁企业，在深圳各大百货商场和购物中心均设有 “茗艺の国”茶叶专卖店. \r\n\r\n公司产品品质过硬，包装精美，除国内销售外并出口多个国家。目前在深圳各大商场设有专卖店十多家，各专卖店均经名师设计装修，风格典雅高档，并成为市场的一大亮点。茗艺の国脚踏实地，展望未来，以不断进取的精神，做出一个倡导中国茶叶品牌先行者的本色. 茗艺の国产品质量上乘，所有茶叶均采自于原产地，经过严密而科学的采制和加工程序，杜绝了流通环节可能出现的质量监督漏洞和价格虚高，保证了产品的高质、高品、使茗艺の国茶叶质量和价格在市场上极具竟争力，树立了良好的品牌形象，从而倍受广大商界和消费者的青睐。 ', null, '茗艺の国', '1', null);
INSERT INTO `brand` VALUES ('1136', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '  “茶艺乐园”是一家专营极品名茶、茶具、茶艺礼品、及进行茶文化推广的企业。1993年茶艺乐园（中国）有限公司在深圳开设广东省内最早的一家台湾式茶艺馆。经过十多年的不断拓展和艰辛经营，茶艺乐园（中国）有限公司已形成颇具规模的连锁公司，以格调高雅、技艺精湛、文化气氛浓郁而著称，旗下分店遍布国内重要经济城市，其独特的经营模式和园主的个人魅力，使“茶艺乐园”这一品牌引起业内的注目和钦佩。2005年百福茶业有限公司成立，全面推向国内市场，愿“百福”这颗新星继续发出耀眼的光芒。\r\n', null, '茶艺乐园', '1', null);
