INSERT INTO `brand` VALUES ('1145', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '三星，韩国最大的企业集团三星集团的简称，该集团包括44个下属公司及若干其他法人机构，在近70个国家和地区建立了近300个法人及办事处，员工总数19.6万人，业务涉及电子、金融、机械、化学等众多领域。除此之外三星还是我国古代的天文星象和纹饰。', null, '三星', '1', null);
INSERT INTO `brand` VALUES ('1147', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '7', 'LG集团创立于1947年，年销售额高达730亿美元（2006年数据），全球目前拥有16万员工。是领导世界产业发展的国际性企业集团。LG集团目前在171个国家与地区建立了300多家海外办事机构。事业领域覆盖化学能源、电机电子、机械金属、贸易服务、金融以及公益事业、体育等六大领域。而LG电子是LG集团最大的子公司。LG集团不断向无穷的技术领域发起挑战，并致力于新技术的开发，科研开发是LG的发展重点，也是业务拓展的强大后盾。LG集团在世界6个国家设立了31所研究中心，科研开发的投入已占集团总收入的5%。目前正通过海外研究机构，进一步加强着自身的技术力量，LG集团在美国的芝加哥、圣佛塞、圣迭亚哥，在日本的仙台、在德国的都塞夫和爱尔兰的都柏林等地的科研机构正在利用高尖端的科研设备，大力开展各项科研活动，为实现高科技社会的早日到来而努力。', null, 'LG', '1', null);
