INSERT INTO `brand` VALUES ('1153', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'TCL即The Creative Life 三个英文单词首字母的缩写，意为创意感动生活。是TCL集团股份有限公司的简称，该公司创立于1981年，是目前中国最大的、全球性规模经营的消费类电子企业集团之一，旗下拥有三家上市公司：TCL集团、TCL多媒体科技、TCL通讯科技。目前，TCL已形成多媒体、通讯、家电和部品四大产业集团，以及房地产及投资业务群，物流及服务业务群。', null, 'TCL', '1', null);
