INSERT INTO `brand` VALUES ('1186', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'PRINCESS，1993年诞生在美丽的荷兰。\r\n\r\n荷兰PRINCESS是欧洲著名的家电品牌，她的家用电器遍及世界各地。目前，全球已有80多个国家和地区成功销售荷兰PRINCESS的优质产品。\r\n\r\n荷兰PRINCESS，以独特新颖的设计、高雅时尚的外观和优越安全的品质赢得消费者的青睐，产品均获美国UL和欧洲CE认证，以及中国CQC认证，是质量和信心的保证。\r\n\r\n荷兰PRINCESS的每一个产品及细节的完成，都凝聚了顶级厨师、发明家和广大消费者的不同理念，在各种创新意念、发明和灵感创作下诞生的PRINCESS产品系列，不但为PRINCESS赢得了大量的产品专利，还获得了欧洲“优秀工业设计奖”和由欧盟消费者协会颁发的“受消费者欢迎”奖项。\r\n', null, '荷兰PRINCESS', '1', null);
INSERT INTO `brand` VALUES ('1187', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '海尔是世界白色家电第一品牌，1984年创立于中国青岛。截至2009年，海尔在全球建立了29个制造基地，8个综合研发中心，19个海外贸易公司，全球员工超过6万人。2009年，海尔全球营业额实现1243亿元，2010年品牌价值已达207.65亿元。海尔积极履行社会责任，援建129所希望小学，制作212集科教动画片《海尔兄弟》，是2008年北京奥运会全球唯一白电赞助商。\r\n', null, '海尔', '1', null);
INSERT INTO `brand` VALUES ('1188', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '卡萨帝，是海尔集团的高端子品牌，是具有意大利血统的国际高端艺术  \r\n家电和嵌入一体化橱电品牌，她经过全球8个研发中心、28个合作研发机构（如麻省理工等）、300多位设计师（来自意大利、英国、德国、法国、美国、日本、中国等12个国家）的倾力研发设计，经过全球29个制造基地200多位工程人员5年的努力，于2007年9月20日在中国面世。 ', null, '卡萨帝', '1', null);
INSERT INTO `brand` VALUES ('1191', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '剑桥大学成立于1209年,是世界十大学府之一.3位诺贝尔奖得主出自此校.剑桥大学位于风景秀丽的剑桥镇,著名的康河横贯其间.\r\n    众所周知剑桥大学是英国最古老的学府之一.16世纪时，剑桥品牌只供剑桥学子及皇室成员穿着，以作为一种身份的象征。现在，剑桥概念店遍及欧洲甚至世界各地，为许多高级行政人员所青睐。美国前总统克林顿和新加坡前总理李光耀等政界名人都曾身穿剑桥服饰，而剑桥皮具其整体设计既突出了现代生活中男装品牌自我个性的张扬,深蕴着古朴素雅的优良传统之外,同时演绎着现代时尚经典,订立于优良传统,\"力臻完美\"的永恒信念,选料考究,做工精雕细刻,品位独特.每一个细节都做到一丝不苟,每一寸内外都倾注\"剑桥\"皮具品牌的潜心研究.\r\n     剑桥大学的励精图治,满载荣誉,奠定了\"剑桥\"皮具品牌的崇高地位.多年来,成为注重实效成功人士追求的目标.\r\n', null, '剑桥大学', '1', null);
