INSERT INTO `brand` VALUES ('1203', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '   宁波永发集团有限公司始创于1988年，总部位于浙江宁波，是目前国内最大的集研发、生产、服务于一体的专业化生产实体安防和金融产品的企业。拥有首批中国名牌、中国驰名商标、行业唯一一家中国保险箱行业标志性品牌的荣誉。\r\n    作为一家专注于安防产品的杰出民营企业，20年来在实践中稳健成长，成为中国改革开放成功推进的标杆性企业。至今已开发出包括防盗保险箱、防火保险柜、枪械柜、金库门、ATM自动取款机等安防、金融产品在内的5大类（附：防火、防盗、防磁、防盗防火、多功能媒体柜）、9个系列（附：酒店保（险）管箱、商务保（管）险箱、文件柜、枪柜、车载保险箱、金库门、ATM机、投币柜、智能点钞机等300多个品种规格的产品，拥有全球最齐全最专业的产品群，以满足社会各阶层的需求。', null, '永发保险箱', '1', null);
INSERT INTO `brand` VALUES ('1211', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '成立于1991年的珠海格力电器股份有限公司是目前全球最大的集研发、生产、销售、服务于一体的专业化空调企业，2010年实现营业总收入608.07亿元，净利润42.76亿元，连续9年上榜美国《财富》杂志“中国上市公司100强”。 \r\n       格力电器旗下的“格力”品牌空调，是中国空调业唯一的“世界名牌”产品，业务遍及全球100多个国家和地区。家用空调年产能3000万台(套)，商用空调年产能400万台(套)；2005年至今，格力空调连续6年全球销量第一。 \r\n作为一家专注于空调产品的大型电器制造商，格力电器致力于为全球消费者提供技术领先、品质卓越的空调产品。在全球拥有珠海、重庆、合肥、郑州、武汉、巴西、巴基斯坦、越南8大生产基地，6万多名员工，至今已开发出包括家用空调、商用空调在内的20大类、400个系列、7000多个品种规格的产品，能充分满足不同消费群体的各种需求；拥有专利3500多项，自主研发的超低温数码多联机组、高效离心式冷水机组、G10变频空调、超高效定速压缩机等一系列“国际领先”产品，填补了行业空白。', null, '格力', '1', null);
