INSERT INTO `brand` VALUES ('1230', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '西门子股份公司创建于1847年。自1906年生产出第一台吸尘器至今，西门子一直以为亿万家庭提供最优质产品而享誉国际家电产业。今天，在经历了165年辉煌历史后，西门子仍以其一如既往秉持的创新精神引领国际家电业，并以其在尖端技术的领先优势蜚声全球。西门子家电代表着优良的品质、时尚的设计、可靠的性能，更重要的是我们只选用经层层筛选、严格测试的材料制造而成的产品，一切想消费者所想，一切为消费者所需。', null, '西门子', '1', null);
INSERT INTO `brand` VALUES ('1232', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '    “陶园梦1973”（Tao Yuan Meng 1973 factory）来自中国著名的北方瓷都.唐山；是家居日用酒店的中国知名品牌。峰峰矿区诚信瓷业有限责任公司创建于1988年，工厂占地面积达2万多平方米；总投资达4000多万元；骨质瓷年产量达500多万种；是首家进驻高新技术开发区的陶瓷公司。\r\n    本公司创建至今，一直醉心于陶瓷的研究设计，全方位打造高级骨质瓷；生产及销售于一体的现代综合型企业；以独特创新的花面、新颖优雅的外观造型、令人耳目一新；营造传达着新的环保、健康的生活方式和生活品味。\r\n', null, '诚信', '1', null);
INSERT INTO `brand` VALUES ('1245', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '成立于1875年的东芝公司，在世界家电前十强中排名第八。我们拥有日本最大规模的研发设施，并且从未间断创新和开拓。百余年来，东芝公司在技术和产品发明领域中创造了许多“世界第一”，其中，就包括世界第一台电饭煲。\r\n\r\n', null, '东芝饭煲', '1', null);
INSERT INTO `brand` VALUES ('1254', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '创始人Calvin Klein 1942年生于美国纽约，就读于著名的美国纽约时装学院（F.I.T），1968年创办Calvin Klein“卡文克莱”公司，Calvin Klein崇尚极简主义和现代的都会感，大量运用丝、缎、麻、棉与毛料等天然材质，搭配利落剪裁和中性色彩，呈现一种干净完美的形象，也奠定了Calvin Klein的设计基调。Calvin Klein一直坚守完美主义，每一件Calvin Klein产品都显得非常完美，成为了新一代职业妇女品牌选择中的最爱。Calvin Klein有（高级时装）、（高级成衣）、Calvin Klein（牛仔）三大品牌，另外还有出品休闲装、袜子、内衣等用品。而我们施雅专柜，正是CK品牌袜类商品在华南区的唯一授权代理商。\r\nCalvin Klein注入时尚设计的精神特质，将最新的时尚流行元素以整合，以“简约自然”“时尚前卫”“随意休闲”“真实唯美”“奔放无阻”的代表性风格，新的品牌风格也为忙碌的都市人带来了一种闲逸的休闲文化体味。\r\n\r\n', null, 'CK', '1', null);
INSERT INTO `brand` VALUES ('1262', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', null, null, '永丰源', '1', null);
INSERT INTO `brand` VALUES ('1283', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '创立于1890年的水晶品牌Mats Jonasson 如今已经成为瑞典珍贵的历史文化遗产，世界级的水晶艺术家和工艺大师团队，成就了Mats Jonasson经典唯美的百年光华。Mats Jonasson作品的每个步骤都是纯手工完成，细节雕刻极为细腻，它所具有的收藏价值被世界所认可。', null, '欧典水晶', '1', null);
INSERT INTO `brand` VALUES ('1284', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '    拉蒙集团公司于1984年成立于美国洛山矶，旗下分公司遍布于美国亚特兰大、德国法兰克福、中国香港、深圳、上海等地，公司成立以来，一直本着“提高产品设计品质、美化顾客文化人生”的宗旨，竭诚为国内外广大客户提供具有经典特色、畅销超值的产品和服务。', null, '派拉蒙电话机', '1', null);
