INSERT INTO `brand` VALUES ('1292', '2020-09-22 06:26:31', '2020-10-07 14:54:22', '2', '1', '虎牌是日本主要生产小家电生活用品的公司。自1923年成立以来，虎牌一贯致力于将先进技术运用于新产品之中。以引导新的社会生活方式。我们从生产热水品瓶开始，发展到电饭锅/保温锅、厨房用品、储藏 用品等其他家用电器用品。我们的厨房用品，储藏用品等得到了广大消费者的厚爱，商品种类也发展到家庭住宅用品和户外生活用品。多年来，本公司产品品质管理从品质调查和提高管理工厂的现代化水准，取得了一步步稳步的提高。虎牌产品以优良品质广为人知并得到了广大消费者的喜爱。', '/upload/image/202010/e2f0445e-3496-4fed-913a-dc3815c74441.jpg', '虎牌', '1', null);
INSERT INTO `brand` VALUES ('1294', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '品牌名称：英氏（中文）英谐音婴, 氏是大家庭意思，寓意“健康宝宝的快乐大家庭”。\r\n          Yeehoo(英文) 模拟新生儿咿咿呜呜的声音。\r\n品牌创立：1995年\r\n品牌创始人：郭超英女士\r\n品牌定位： 0-4岁中高端育婴家庭\r\n品牌理念：呵护宝宝，关爱妈妈！\r\n品牌个性：优雅童真\r\n品牌覆盖率：（2010年统计）\r\n——总城市布点122个\r\n——总零售网点586个\r\n——全国一级商场覆盖率达95%\r\n——全国一、二级城市覆盖率达89%\r\n——一类商场销售排名前3名占90%\r\n', null, '英氏', '1', null);
INSERT INTO `brand` VALUES ('1298', '2020-09-22 06:26:31', '2020-12-29 17:27:59', '3', '1', '苹果公司总部位于美国加利福尼亚的库比提诺，核心业务是电子科技产品，目前全球电脑市场占有率为3.8%。苹果的Apple II于1970年代助长了个人电脑革命，其后的Macintosh接力于1980年代持续发展。最知名的产品是其出品的Apple II、Macintosh电脑、iPod数位音乐播放器和iTunes音乐商店，它在高科技企业中以创新而闻名。', '/upload/image/202012/976e2de9-b37b-422d-901f-f5bfc8813ffa.jpg', '苹果', '1', null);
INSERT INTO `brand` VALUES ('1306', '2020-09-22 06:26:31', '2020-10-07 11:31:18', '1', '1', null, '/upload/image/202010/751230bd-17ba-494b-8d33-d0ae4e62debb.jpg', '菲仕乐', '1', null);
INSERT INTO `brand` VALUES ('1309', '2020-09-22 06:26:31', '2020-10-07 14:49:59', '1', '2', '浙江苏泊尔股份有限公司是中国最大、全球第三的炊具研发制造商，也是国内炊具行业首家上市公司。苏泊尔创立于1994年，总部设在中国杭州，目前在中国及海外拥有5大生产基地，9000多名员工，旗下生产的炊具及生活家电产品销往全球多个国家。', '/upload/image/202010/7e2b1b02-d8bb-490e-9be6-3271054d83df.jpg', '苏泊尔', '1', null);
INSERT INTO `brand` VALUES ('1311', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'ROWENTA 好运达  \r\n1984年德国好运达公司注册了“Rowenta”（好运达）商标，开始生产小家电产品，并于1988年加入了法国赛 博集团，经过了几十年的发展，已成为欧洲领先的高档小家电品牌。德国好运达的市场定位为高档小家电品牌，以高功能，高品质为产品的导向，来满足高层次消费者的需求。其严谨高效的德国尖端科技，保证新产品的卓越性能，经典简约的设计风格，为高科技产品增添美学享受，让您在喧嚣的世界中发现平静与和谐，营造洁净舒适的家居环境，给你带来平和宁静的高品质生活。 ', null, '好运达', '1', null);
INSERT INTO `brand` VALUES ('1323', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '以独创的技术，为世界贡献最优质产品是YONEX永远的宗旨。\r\n', null, '尤尼克斯', '1', null);
INSERT INTO `brand` VALUES ('1325', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '    「雅芳婷」品牌于一九八三年创立，为床上用品行业创造新的定义。目前，雅芳婷不但成为全港最著名及最有价值的香港名牌之一，其市场占有率超过百份之五十，更一直成功稳占全港高级床品市场连年销量冠军。\r\n　　雅芳婷A-Fontane由古诗中“font”一词异化而来，意指清泉、源泉之意。寓意品牌能象清泉一样让人身心舒畅。读音谐同英国芭蕾舞后玛歌芳婷，其优雅高贵的舞姿也很好地暗示了雅芳婷A-Fontane品牌的高尚和美好。\r\n　　以“健康生活，健康睡眠”为宗旨的雅芳婷A-Fontane率先将高科技元素、环保及健康的概念注入传统床上用品，填补了高科技床上用品的空白，开创了睡眠科技的潮流。', null, '雅芳婷', '1', null);
INSERT INTO `brand` VALUES ('1329', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'Burberry 是一个奢侈品牌，具有英国独特的敏锐性，极高的国际知名度以及非凡的品牌价值，一直深受男女老少的青睐和追捧。\r\n\r\n博柏利今天是通过不断推进设计创新以提升其传统的实力，重塑其图标以提高他们渴望的魅力，突出他具有现代和经典的特点和卓越性，使这些核心价值观影响着今天和未来。', null, '博柏利', '1', null);
