INSERT INTO `brand` VALUES ('1337', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '利快homestore——欧洲进口家居用品连锁主题店，从1996年开始，利快与20多个国际一线家居品牌携手进入中国市场，是最早在中国从事进口家居用品与欧洲生活方式推广与服务的品牌，是将进口家居用品引入中国的领航者。\r\n\r\n分布于全世界的49个工厂和设计室，可以提供多达20万个产品的选择机会，拥有种类丰富的世界一流家居用品。我们提供的家居用品涵盖清洁、晾烫、卫浴、餐厨、保温等全家居生活系列，可以全方位的满足追求高品位生活的人群对高品质家居用品的需求。\r\n\r\n这里汇聚了全球一流的设计师团队，每一件家居用品都经过设计大师们精雕细琢、精心打造，利快的很多产品荣获IF奖, 红点奖等国际知名设计大奖。', null, '利快', '1', null);
