INSERT INTO `brand` VALUES ('1348', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '历史\r\nLG电子中国发展概况 \r\n告别了2008，我们一同步入2009。在这辞旧迎新之际，我首先要向全体社员表示衷心的感谢，感谢你们在2008年辛勤的劳动和无私的付出，同时祝大家新年快乐、万事如意！\r\n\r\n自1993年惠州法人的成立为起点，LG电子进入中国已有16年。通过16年以来全体员工的共同努力，以及生产、营销、研发、人才的本土化与国际化，已经构筑了完善的事业结构，成为生产和提供高端数字显示、数字家电、移动通信、数字多媒体等产品为一体的，中国最具代表性的消费电子及信息通信企业。与此同时，LG电子也通过不断提高品牌知名度和积极开展营销活动，实现了销售额的逐年稳步增长，其中液晶电视、对开门冰箱等高端产品的销售成为主要增长点。\r\n\r\n目前，以北京的LG电子（中国）有限公司为中心，LG电子在中国拥有惠州、天津等 13个生产法人（产品工厂）、5个分公司（地区营销业务）、5个技术服务中心，3个研发和1个设计中心。截至2008年，员工达36,000余人。2008年，LG电子中国销售额达到100亿美元，LG平板电视、对开门冰箱、滚筒洗衣机、手机、显示器等产品均得到市场认可，深受消费者喜爱。\r\n', null, 'LG', '1', null);
INSERT INTO `brand` VALUES ('1383', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '范思哲（VERSACE)，一个曾经引领时尚的人物，一个标志着顶尖潮流的名字，更是一个兼具高雅与前卫的品牌。拥有这个名字的人，被国际时装界喻为不朽的大师，拥有这个品牌的人，也无不为拥有它而感到自豪。\r\n\r\n从年轻时起，VERSACE就感到自己和古希腊有着密切的联系。他更将古希腊蛇发女妖的头像和希腊图案用在自己的商标中。这个标志是希腊神话中的蛇发女妖玛杜莎，美女的头发由一条条蛇组成，发尖是蛇的头。她代表着致命的吸引力，她以美貌诱人，见到她的人即刻化为石头，这种震慑力正是范思哲的追求。', null, '范思哲', '1', null);
INSERT INTO `brand` VALUES ('1385', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '美国“霍华德？米勒”（Howard Miller)系列钟，原装美国进口，采用德国“肯宁家（Kieninger)机芯，高档典雅，收藏首选。', null, '美国“霍华德？米勒”钟', '1', null);
INSERT INTO `brand` VALUES ('1393', '2020-09-22 06:26:31', '2020-12-29 17:29:33', '2', '1', '康维他公司开创于半个多世纪以前，旨在发扬光大创始人克劳德?斯特拉特福德的养蜂兴趣及营养观念。康维他公司利用大自然恩赐的蜂蜜为主要原料，制作最高品质标准的天然保健品。\r\n    康维他公司的产品由设在新西兰丰盛湾地区的工厂制造。这个高科技设施按照“药品生产和管理规范（GMP）”的标准建造和管理，并获得澳洲“医疗产品管理局（TGA）”颁发的执照。我们为这项技术感到自豪，因为这项技术适得其所—保护蜂蜜产品的天然精华，使顾客获得最大的好处。该技术还意味着康维他公司将能够满足未来发展并在未来数年内满足健康和安全方面的要求。', '/upload/image/202012/420594a0-bfaa-4f11-bfe1-e275ba4347f7.jpg', '康维他', '1', null);
INSERT INTO `brand` VALUES ('1405', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '源于澳洲 臻于经典 -- SHERIDAN公司的前身，澳大利亚棉纺织品有限公司（ACTIL），创立于1942年。她是澳大利亚第一家以国产和进口棉花为原料，生产床上用品的纺织公司。作为南半球深受人们喜爱的卧室和浴室品牌，同时也是国际知名的床品品牌之一，SHERIDAN 半个多世纪以来，始终坚持以手工绘图，体现澳大利亚瑰丽的风情和文化，更以全球的质量保障体系把最舒适的产品奉献给全球的顾客。SHERIDAN的床品，已经不仅是一种生活品味的体现，更是全球顾客珍藏的艺术佳品.', null, '喜来登', '1', null);
