INSERT INTO `brand` VALUES ('1409', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '小象电商集团视光中心——位于深圳市环市中路小象电商集团总店，于2000年成立，是国内汇集当今世界眼镜专业品牌的连锁企业。目前在深圳、南宁共有5家眼镜专业分店，分布在深圳市珠江新城深圳国际金融中心正佳广场、时代广场、广西南宁地王广场。\r\n● 崇尚品牌新时尚\r\n多年来，小象电商集团视光中心，定位高端，崇尚个性品牌、时尚科技，荟萃眼镜领域的顶尖品牌，及时将世界最新的前沿风尚、潮流带给消费者，倡导时尚品位和个性，不断超越消费者的期待，实现眼镜专业与时尚生活的相结合，致力眼镜时尚，品味生活的高层次体验，创造一个与顾客心灵沟通，唤醒消费者对时尚生活的梦想。\r\n● 把专业做到极致\r\n从中心成立起，中心聘请广东省视光学学会的眼科教授担任专业验光师，力求对每一位消费者的视力健康进行严谨、眼科专业的检查，全力解决消费者视力上的困扰，提供眼镜高科技新产品。同时，中心拥有技术、服务一流的专业人员，根据顾客的需求，为顾客提供贴心、个性化优质服务，把专业做到极致，将视光学领域的专业化优势与顾客个性化顾问服务的完美整合，成为深圳市眼镜高端的专业零售店典范，为国内眼镜行业画上一道优美弧线。', null, '小象电商视光中心', '1', null);
