INSERT INTO `brand` VALUES ('1427', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '    Covla Cduui（卡洛奇）品牌是德国著名时装设计师COVLA CDUUI.QI（卡洛奇）创立于1958年，它是男士时尚休闲服装领域的权威品牌，崇尚清新、简洁、舒适、爽朗的着装风格，是25-55岁之间时尚男士在工作和休闲、生活及其它高雅消费场所的着装标准。更是欧洲新贵一族和成功人士争相追捧的经典品牌。\r\n2001年由台湾地波里国际开发有限公司成功将德国Covla Cduui（卡洛奇）引进亚洲市场，并迅速拓展和占领东南亚市场。\r\n2006年3月台湾地波里国际开发有限公司授权深圳海泉贸易有限公司为中国大陆地区总代理，隆重推出德国Covla Cduui（卡洛奇）品牌。\r\n', null, '卡洛奇', '1', null);
INSERT INTO `brand` VALUES ('1434', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '卡尔丹顿高尔夫系列，它不仅仅是球场上时尚的展现，更是工作生活中的绚丽风景；商务休闲的产品风格，丰富的色彩搭配，在任何场合都体现出非凡的品味与自信。主要消费群体是热爱及向往高尔夫运动30-45岁的成功人士、政府官员、高级白领、企业高管等。\r\n\r\n', null, '卡尔丹顿Golf', '1', null);
