INSERT INTO `brand` VALUES ('1466', '2020-09-22 06:26:31', '2020-10-07 14:57:36', '1', '1', '历经近50年的辉煌发展史，Panasonic空调现已成为在世界拥有广泛知名度和美誉度的空调品牌，在全球共有三大生产基地：日本草津松下空调机事业本部、马来西亚松下空调器有限公司和深圳松下空调器有限公司。\r\n   作为Panasonic空调全球的三大战略性生产基地之一，深圳松下空调器有限公司自1993年6月正式成立以来，一直把“通过事业发展为社会做贡献”作为企业的经营理念，牢牢扎根本土，借助松下近50年积累下来的丰富技术开发和生产制造经验，不断拓展事业领域，紧密配合消费者个性化发展的需求。', '/upload/image/202010/ff822a2b-a5b4-4e50-a669-7165caaf2f2b.jpg', '松下空调', '1', null);
