INSERT INTO `brand` VALUES ('1567', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '“SICY COLLECTION适时雅集”一个典雅与时尚融于一体的香港品牌。选用日本最新颖、时尚、富有手感的面料，经过精工细作，严格质检，塑造出休闲、雅致、简约的女性服装新时尚，演绎浓郁的时代气息。\r\n\r\n跨越地域的界限，远离闹市的追逐和枷锁，突破文化思想的差异，集各地方不同特色于一体的时尚焦点。没有明确由来的传统既有意念，在互相对比和衬托中形成一个盛载过去、现在与未来的潮流新概念。\r\n\r\n    结合东方人体特征、精神气质和价值取向，设计师融合东西方时装文化理念，创意的设计，尽显玲珑窈窕线条，带给现代女性尊贵、超凡的气质，融合繁忙都市中女性的个性与品味。每一季度推陈出新的时装系列，极力诠释以人为本、物有所值。“庄重、优雅、不落俗套”的服装佳品，总是令人振奋，赏心悦目，可以说与它结缘，您将抛开都市的束缚，在展于自己的贴身空间中追随无间，彰示您的尊贵和自信。\r\n\r\n', null, '适时雅集', '1', null);
INSERT INTO `brand` VALUES ('1568', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'sanpowa的女人，美得简洁而又精致，是经历了时间雕刻的美，亦如山之峦，水之流，自然隽永，不再有粉嫩之堆砌，青春之乍现，却散发出不可忽略的韵味——时之韵。', null, 'sanpowa', '1', null);
INSERT INTO `brand` VALUES ('1585', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'STACCATO 2011春夏产品以 Secret Garden (秘密花园)、Modern Bohemian (波希风韵)及Urban Revolution (动感都市) 这3个主题为设计重点，为每位女士于今季塑造不同时尚造型，让女性婀娜妩媚的姿态发放得更淋漓尽致。\r\nSecret Garden (祕密花園)：灵感来自于一位活泼可人的少女喜爱与花作伴，常于神秘花园里穿梭，予人昙花一现的感觉，既甜美亦很珍贵。所以STACCATO今季用上“花园”的元素，以大花装饰、蕾丝、大珠、花布及动物纹 (蛇纹及蜥蝪纹)为主要用料，配上同样是今季大热的裸色系及粉色系，并且加上轻丝物料及扭带蝴蝶，均能带出无限的新鲜感和表现出飘逸的动感，柔和、甜美、优雅之余而充满青春气息，与本季大热的花长裙、碎花连衣裙非常相衬。\r\n\r\n', null, '思加图', '1', null);
INSERT INTO `brand` VALUES ('1586', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', null, null, '香云莎', '1', null);
INSERT INTO `brand` VALUES ('1587', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'FOLUNSI——意大利原创高级商务休闲男装品牌，由希腊裔名门望族艾利泰斯（Elytis）家族成员艾萨斯（Isacc Elytis），于1958年在意大利米兰创建，FOLUNSI——品牌标志寓意“树旁的雅典娜” 图形中刻画智慧女神雅典娜守卫着橄榄树的神圣形象，表达人民对和平的祈望，象征着国家繁荣富强、国泰民安。意大利硬币中100里拉，用的就是这幅画作的浮雕版。这幅雕像于公元前438年由希腊著名艺术家菲狄亚斯创作，代表了人文艺术的颠峰。用“树旁的雅典娜”做印记不仅符合品牌意义，更寓意品牌要创造服装艺术的颠峰。\r\n　　今天FOLUNSI品牌在中国，秉承欧洲最前沿的流行时尚，融合东方经典的人文艺术，一次次颠覆创新，成为服装界最富有生命力的男装品牌。', null, '佛伦斯', '1', null);
INSERT INTO `brand` VALUES ('1588', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '3', '西门子最早在中国开展经营活动可以追溯到1872 年，当时西门子公司向中国出口了第一台指针式电报机。在过去130 多年的时间里，西门子一直活跃在中国市场，并在工业、能源和医疗业务领域处于领先地位。多年来，西门子已经成为中国经济不分可割的一部分，是中国可靠、忠诚、可信赖的合作伙伴。西门子将其环保业务组合与创新解决方案全面投入到与中国的合作中，彰显了其致力于帮助中国实现可持续发展的坚定决心。 \r\n\r\n', null, '西门子', '1', null);
