INSERT INTO `brand` VALUES ('1604', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '经常呆在室内的OL们到了夏季，也想到户外游走，亲近大自然，展现活力的一面。Rustic Fanfare延续上季结集大自然元素的精神，继续以动物纹图案及民族风味的凉鞋为主，不同的是本季设计将采用更夺目的颜色，令女士们在这个夏季大放异彩！猎装一向给人贴近大自然的感觉，但传统设计都以緑色和啡色为主，今季Joy & Peace的设计师突破传统，配以艳丽的彩带，让猎装凉鞋更添朝气活力。而平底凉鞋则以醒目的橡根搭带、彩色的民族绳结作为点缀，犹如少数民族斑斓的编织品一样，充满民族风味，让OL们仿佛置身于大自然之中；Open toes及高跟的设计运用大胆的颜色，加上特别的线条或通花设计，就像夏日盛开的花朵一样，让OL散发青春的自然美！无论上班或休闲，Joy & Peace都可以令OL们释放真我，在每一段人生“履”途，都踏出华美而精彩的乐章！', null, '真美诗', '1', null);
