INSERT INTO `brand` VALUES ('1663', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '  历史，意味着传统与悠久，更代表着品位与经典。DE VERLI，作为巴黎知名的顶级男装定制店，在全球时尚中心香榭丽舍大街已有逾百年历史。关注内涵，注重细节，经典设计与近乎苛刻的做工是DE VERLI家族百年传承的基石。\r\n  DE VERLI家族从创立伊始就以顶级质感布料和精湛裁缝技巧闻名于法国上流社会，其端庄优雅的成衣风格获得贵族富豪和各界名流的青睐。时至今日，DE VERLI产品系列已涵盖了高级内衣、家居服、皮鞋、皮具及配饰等领域', null, '迪瓦尔', '1', null);
INSERT INTO `brand` VALUES ('1703', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '积架JAGUAR自1992年在英国创立以来,以80年悠久历史而获全球一致的肯定。80年代中期,为满足JAGUAR品牌拥护者的需求,JAGUAR集团总裁WALTERFREYT华特福雷心中浮起造高品质服饰与香氛的念头,从而引伸出JAGUAR的系列产品: 香水系列、皮件系列、精品系列、休闲服系列、高尔夫系列、毛巾系列、手表、眼镜、鞋类等。不断勇于创新赋予JAGUAR更深激情的翅膀, 不仅一如既往的延续了它的成熟稳重,且有时尚休闲风格, 严谨的工艺和独树一帜为上流社会人士带来有如皇家般的享受,使其迅速风靡整个欧洲。', null, '积架', '1', null);
