INSERT INTO `brand` VALUES ('1843', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '    著名男装品牌SAINTPOULON圣宝龙主要生产及销售高级男仕服饰系列，其全部产品均由名设计师设计，秉承欧洲贵族优良传统，不追求新奇的款式，也不注重亮丽的色彩，而是靠古朴、典雅和舒适去迎合高品位男仕的需求，高品质的产品使SAINTPOULON圣宝龙成为男装品牌的顶尖者。\r\n    目前SAINTPOULON圣宝龙服饰专卖店已遍布中国大部分主要城市，为时尚男仕提供更多的选择及完美的服务。\r\n    SAINTPOULON圣宝龙服饰，介于经典与休闲的典型，是为成功男仕度身定制的高档商务休闲服饰。追寻卓越、高效、共利，为顾客创造价值，健康创造幸福，是圣宝龙品牌及企业的追求。', null, '圣宝龙', '1', null);
