INSERT INTO `brand` VALUES ('2003', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', 'COMPOSE \r\nCompose 系列是为你的装扮加添一点小趣味或亮点的最佳选择。充满调配的乐趣，你可因应个人风格而自由自由搭配。\r\nRING UPON RING \r\n由 14K 黄金或纯银所打造，这些指环糅合了成熟细致与充满趣味的特质。大多数 PANDORA 指环都可以进行“堆叠”。  \r\nLIQUID SILVER \r\n以水作灵感， Liquid Silver 系列是集优雅、时代感及款式长青的系列。  这组系列包括成熟细致的耳环、吊坠、 指环与手链。 单独一件 Liquid Silver 产品已足显个性，但几件“堆叠”在一起的手链或指环更带给你新颖的时尚。 \r\nLOVEPODS \r\n黄金 \r\n以 18K 黄金精工打造的指环、耳环、项链、吊坠与手链配以手工镶嵌的宝石，演绎永久长青的优雅。 LovePods 的自然与真实体现在设计、原材料与品质方面\r\n白金 \r\nLovePods 新款的白金系列，精工打磨的闪烁钻石配以润滑细致的白金，散发出令人忘怀的浪漫诗意。 指环有八或六角形款式。 Pave 指环镶嵌多达 37 颗钻石，使产品系列更完美。  ', null, '潘多拉', '1', null);
