INSERT INTO `brand` VALUES ('2166', '2020-09-22 06:26:31', '2020-10-07 11:34:37', '1', '1', '康宁公司是特殊玻璃和陶瓷材料的全球领导厂商。基于150多年在材料科学和制程工艺领域的知识， 康宁创造并生产出了众多被用于高科技消费电子、移动排放控制、通信和生命科学领域产品的关键组成部分。凭着超过一百五十年的不断创新，康宁成为了特殊玻璃与陶瓷领域的全球领导厂商，所创造与生产的关键组成部分使高科技系统的产生成为了可能。', '/upload/image/202010/0d15ffce-7ea3-4886-935f-06e21b1bcce9.jpg', '康宁', '1', null);
INSERT INTO `brand` VALUES ('2347', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '  \r\n \r\n关于罗莱罗莱历程罗莱简介罗莱故事罗莱理念罗莱荣誉罗莱公益广告片 罗莱，致力于为消费者创造高品质家居生活和优质睡眠体验。凭借欧式化、经典的品牌风格定位，罗莱以其与生俱来的高贵气质和优雅精致风格深受中国万千消费者喜爱，卓越的产品品质和鲜明的品牌形象在市场上独树一帜。\r\n作为国内家纺时尚潮流引领者，罗莱在欧洲和中国拥有两大研发设计中心，并与国内外顶级家纺专业设计机构及面料商长期紧密合作，敏锐捕捉家纺流行趋势，通过产品、服务的创新满足日益多元化家居生活需求，成为精英人群的生活标签。\r\n经典罗莱，品味生活——罗莱也已成为优质家居生活的代名词。 \r\n \r\n \r\n \r\n', null, '罗莱家纺', '1', null);
