INSERT INTO `brand` VALUES ('2628', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '智高（chicco）为意大利阿佐娜公司（Artsana.S.P.A）最著名的婴幼儿品牌。阿佐娜公司由卡特里先生于1946年于意大利COMO成立。从生产医药医疗用品开始，逐步扩展业务至婴幼儿用品、化妆品、玩具、童车椅等系列。\r\nChicco（智高）取自卡特里先生的大儿子思里克的呢称，是意大利男孩的可爱名字。\r\n智高产品种类齐全，为妈妈和0-6岁宝宝提供全方位的呵护，是每个家庭信赖的保证。\r\nCHICCO智高产品生产者阿佐娜公司，通过与专业医院的合作研究，全面考虑宝宝日常生活的需要，在生产中运用高精密的技术，以保证产品的实用性和有效性。所有的智高产品都经过严格的化学检测、毒性检测、物理稳定性检测和可靠性检测。', null, '智高', '1', null);
