INSERT INTO `brand` VALUES ('2688', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '  希望与有缘人“配合”的“Combination”而缩写成“Combi”\r\n  在1968年由希望成为协助\"母亲与婴儿\"的“伙伴”企业而更名为现在的“康贝(Combi)股份有限公司”。\r\n  Combi于2002年采用新的品牌标语，重新决定不只对母亲与婴儿提供协助，更希望扩及所有的育儿者，让每个人都能享受幸福的育儿生活。\r\n  同时，将沟通的对象扩展到所有家人及全体社会，开发并提供各种软、硬体，协助创造一个幸福且充满温馨的交流场所。\r\n', null, '康贝', '1', null);
