INSERT INTO `brand` VALUES ('2828', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '    百藏馆一直致力于弘扬民族艺术陶瓷文化，所展示的艺术品都是经过精心挑选，都是作者的代表之作，因此受到社会各界的广泛认可，深受好评。百藏馆也是同时经营江西景德镇和湖南醴陵两大瓷都顶级工艺美术大师精品的艺术品机构。\r\n    百藏馆作为一个当代文化艺术的先行者，一个恒久发展的企业品牌，他倡导的是一种对当代艺术陶瓷收藏、投资、馈赠三位合一的市场全新理念，他所追求的不仅仅是藏品形象和社会影响力，更是一种对品质精益求精、永无止境的执着态度。\r\n    百藏馆作为一个专业、值得信赖的艺术品牌，他不仅是引领当代艺术陶瓷市场的风向标，更是一种对社会、对消费者、对收藏者的承诺和责任。\r\n    百百藏馆从建立开始就秉承“诚信为本”的理念，受到了收藏界和投资爱好者的高度赞扬。\r\n    陶瓷文化是华夏文明的永恒课题，百藏馆将再接再厉，为让世人更加了解现代陶瓷艺术，深入地了解和认识陶瓷艺术的无穷魅力而努力。\r\n    典藏国瓷，从百藏馆开始……', null, '百藏馆', '1', null);
