INSERT INTO `brand` VALUES ('3328', '2020-09-22 06:26:31', '2020-09-22 06:26:31', '0', '1', '英国Britax宝得适集团儿童安全用品公司是设计、制造和销售汽车儿童安全座椅，手推车和旅行用品的专业公司。公司自1960年代开始生产设计汽车儿童安全座椅。 \r\n秉承航空工业极其严格的设计测试及生产工艺标准，企业内部产品质检超过欧盟汽车儿童安全座椅ECE R44/04标准2倍以上。每个安全座椅均在英国BSI国家标准局注册在案以跟踪其安全性能。\r\n', null, '宝得适(Britax)', '1', null);
