  `store_id` bigint(20) NOT NULL COMMENT '店铺',
  `is_export` bit(1) DEFAULT b'0' COMMENT '是否已导出',
  `export_date` datetime DEFAULT NULL COMMENT '导出时间',
  `is_refund` int(11) DEFAULT '0',
  `erp_sync` varchar(50) DEFAULT NULL COMMENT '同步状态',
  `erp_sync_time` datetime DEFAULT NULL COMMENT '同步时间',
  `erp_msg` varchar(6000) DEFAULT NULL COMMENT 'ERP同步报文',
  `data_source` int(11) DEFAULT NULL COMMENT '数据来源',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `sn` (`sn`) USING BTREE,
  KEY `ind_Orders_area_id` (`area_id`) USING BTREE,
  KEY `ind_Orders_member_id` (`member_id`) USING BTREE,
  KEY `ind_Orders_paymentMethod_id` (`payment_method_id`) USING BTREE,
  KEY `ind_Orders_shippingMethod_id` (`shipping_method_id`) USING BTREE,
  KEY `ind_Orders_store_id` (`store_id`) USING BTREE,
  CONSTRAINT `FK134k7ig0kuobpn7qndeuaav12` FOREIGN KEY (`payment_method_id`) REFERENCES `payment_method` (`id`),
  CONSTRAINT `FKl4n2qmc3gf6grt81re6td0sf3` FOREIGN KEY (`store_id`) REFERENCES `store` (`id`),
  CONSTRAINT `FKl7wd8pbflpscqk7dds8ukia5b` FOREIGN KEY (`shipping_method_id`) REFERENCES `shipping_method` (`id`),
  CONSTRAINT `FKp4pvifrisoir4ijx4o3emyrum` FOREIGN KEY (`area_id`) REFERENCES `area` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单';

